  Condition:
  - description: Eligibilty
    id: Condition_1
    instanceType: Condition
    label: Eligibilty
    name: COND1
    text: All eligibility criteria met
    uuid: 00000000-0000-4000-8000-000000001343
  - description: Condition 1
    id: Condition_2
    instanceType: Condition
    label: ''
    name: COND2
    text: Stopped once bedside PG is <60 mg/dL
    uuid: 00000000-0000-4000-8000-000000001344
  - description: Condition 2
    id: Condition_3
    instanceType: Condition
    label: ''
    name: COND3
    text: 5 minutes after bedside PG reaches <60 mg/dL and insulin infusion is stopped.
    uuid: 00000000-0000-4000-8000-000000001345
  - description: Injection site assessment only required for IMG
    id: Condition_4
    instanceType: Condition
    label: Injection site assessment
    name: COND4
    text: Injection-site assessment for IMG only.
    uuid: 00000000-0000-4000-8000-000000001346
  - description: Fasted
    id: Condition_5
    instanceType: Condition
    label: ''
    name: COND5
    text: At periods 1 and 2 pts should have fasted at least 8 hoours before any study
      procedures
    uuid: 00000000-0000-4000-8000-000000001347
  - description: Childbearig potential
    id: Condition_6
    instanceType: Condition
    label: ''
    name: COND6
    text: Only females of childbearing potential
    uuid: 00000000-0000-4000-8000-000000001348
  - description: Females
    id: Condition_7
    instanceType: Condition
    label: ''
    name: COND7
    text: Only Females when needed to confirm postmenopausal status
    uuid: 00000000-0000-4000-8000-000000001349
  - description: Patient admission PG level critieria
    id: Condition_8
    instanceType: Condition
    label: Admission
    name: COND8
    text: Admission can be rescheduled if PG level is not 90 to 250 mg/dL on Day 1.
    uuid: 00000000-0000-4000-8000-000000001350
  - description: Patient discharge critieria
    id: Condition_9
    instanceType: Condition
    label: Discharge
    name: COND9
    text: Patient may be discharged 6 hours after glucagon administration. A patient
      may remain inpatient at the CRU at the discretion of the investigator.
    uuid: 00000000-0000-4000-8000-000000001351
  - description: Scope of patient physical examination
    id: Condition_10
    instanceType: Condition
    label: Physical Examination
    name: COND10
    text: After screening, medical assessment only performed to include medical review
      and targeted examination, as appropriate.
    uuid: 00000000-0000-4000-8000-000000001352
  - description: Ability of patient to undergo hypoglycemia induction
    id: Condition_11
    instanceType: Condition
    label: Hypoglycemia induction check
    name: COND11
    text: "Review patients\u2019 insulin regimens to confirm acceptability to undergo\
      \ the procedure to induce hypoglycemia."
    uuid: 00000000-0000-4000-8000-000000001353
  - description: Provision of carbohydrate-rich meal.
    id: Condition_12
    instanceType: Condition
    label: Carbohydrate-rich meal.
    name: COND12
    text: "After completion of all PK sampling, patients will be provided a carbohydrate-rich\
      \ meal. The investigator will ensure the patient\u2019s PG is stable. A prandial\
      \ insulin dose will be administered if needed."
    uuid: 00000000-0000-4000-8000-000000001354
  - description: Timing of insulin infusion
    id: Condition_13
    instanceType: Condition
    label: Timing of insulin infusion
    name: COND13
    text: Procedures in Period 2 will occur at approximately the same time as those
      in Period 1. Insulin infusion is stopped once bedside PG is <60 mg/dL.
    uuid: 00000000-0000-4000-8000-000000001355
  - description: Patient fasting for labs tests
    id: Condition_14
    instanceType: Condition
    label: Patient fasting
    name: COND14
    text: Patients do not need to fast for samples at screening or follow-up. At Periods
      1 and 2, samples should be collected from patients who have fasted at least
      8 hours before any study procedures.
    uuid: 00000000-0000-4000-8000-000000001356
  - description: Type of pregnancy tests
    id: Condition_15
    instanceType: Condition
    label: Pregnancy tests
    name: COND15
    text: Serum pregnancy test will be performed at screening. Urine pregnancy test
      will be performed at every admission period and follow-up visit if applicable.
    uuid: 00000000-0000-4000-8000-000000001357
  - description: FSH testing
    id: Condition_16
    instanceType: Condition
    label: FSH testing
    name: COND16
    text: When needed to confirm postmenopausal status.
    uuid: 00000000-0000-4000-8000-000000001358
  - description: Ethanol testing
    id: Condition_17
    instanceType: Condition
    label: Ethanol testing
    name: COND17
    text: Additional tests can be done at the discretion of the investigator.
    uuid: 00000000-0000-4000-8000-000000001359
  - description: Genetic sampling
    id: Condition_18
    instanceType: Condition
    label: Genetic sampling
    name: COND18
    text: Single sample for pharmacogenetic analysis taken prior to/on Period 1 Day
      -1.
    uuid: 00000000-0000-4000-8000-000000001360
  - description: Drug reactions
    id: Condition_19
    instanceType: Condition
    label: Drug reactions
    name: COND19
    text: In the event of drug hypersensitivity reactions (immediate or non-immediate),
      samples will be collected as close to event onset as possible, at event resolution,
      and 30 days following the event. Patients with TE ADA at follow-up/ED will undergo
      additional follow-up.
    uuid: 00000000-0000-4000-8000-000000001361
  - description: Nasal site inspection
    id: Condition_20
    instanceType: Condition
    label: Nasal site inspection
    name: COND20
    text: Nasal inspection both for IMG and LY900018.
    uuid: 00000000-0000-4000-8000-000000001362
  - description: Triplicate 12-Lead ECG
    id: Condition_21
    instanceType: Condition
    label: Triplicate 12-Lead ECG
    name: COND21
    text: Time points may be added for Period 1 and Period 2 if warranted and agreed
      upon between Lilly and the investigator. Predose time point will be between
      insulin infusion stop and study treatment.
    uuid: 00000000-0000-4000-8000-000000001363
  - description: PK (Glucagon)
    id: Condition_22
    instanceType: Condition
    label: PK (Glucagon)
    name: COND22
    text: Sampling times are relative to the time of study treatment administration
      (0 min). Predose time point will be between insulin infusion stop and study
      treatment.
    uuid: 00000000-0000-4000-8000-000000001364
  - description: Plasma Glucose
    id: Condition_23
    instanceType: Condition
    label: Plasma Glucose
    name: COND23
    text: Sampling times are relative to the time of study treatment administration
      (0 min). Predose time point will be between insulin infusion stop and study
      treatment.
    uuid: 00000000-0000-4000-8000-000000001365
  - description: Nasal and Non-Nasal Score
    id: Condition_24
    instanceType: Condition
    label: Nasal and Non-Nasal Score
    name: COND24
    text: Sampling times are relative to the time of study treatment administration
      (0 min). Questionnaire will be collected in both LY900018 and IMG treatment
      groups in both periods.
    uuid: 00000000-0000-4000-8000-000000001366
  - description: Edinburgh Scale
    id: Condition_25
    instanceType: Condition
    label: Edinburgh Scale
    name: COND25
    text: "Sampling times are relative to the time of study treatment administration\
      \ (0 min). During hypoglycemia induction will be when PG \u226475 mg/dL. Predose\
      \ time point will be between insulin infusion stop and study treatment."
    uuid: 00000000-0000-4000-8000-000000001367
  EligibilityCriterion:
  - description: ''
    id: EligibilityCriterion_1
    identifier: '1'
    instanceType: EligibilityCriterion
    label: ''
    name: INC1
    text: "<p>have had a diagnosis of either:</p>\n<ul>\n  <li>\n    <p>[1a] T1DM\
      \ based on the World Health Organization (WHO) diagnostic criteria, and have\
      \ been on the following daily insulin therapy for at least 1 year</p>\n    <ul>\n\
      \      <p>[A] multiple daily injection of long-acting insulin analog (either\
      \ insulin glargine [U-100 or U-300] or insulin degludec [U-100]) and rapid-acting\
      \ insulin analog (insulin lispro, insulin aspart, or insulin glulisine), or</p>\n\
      \      <p>[B] continuous subcutaneous insulin infusion (CSII)</p>    \n    </ul>\n\
      \  </li>\n  <p>Or</p>\n  <li>\n    <p>[1b] T2DM based on the WHO diagnostic\
      \ criteria, and have received the</p>\n    <p>following daily insulin therapy\
      \ with or without oral anti-hyperglycemic medications (OAMs) for at least 1\
      \ year</p>\n    <ul>\n      <p>[A] insulin: long-acting insulin analog (either\
      \ insulin glargine [U-100 or U-300] or insulin degludec [U-100]) alone, or in\
      \ combination with rapid-acting insulin analog (insulin lispro, insulin aspart,\
      \ or insulin glulisine) or CSII</p>\n      <p>[B] OAM: up to 3 of the following\
      \ OAMs in accordance with local regulations: metformin, dipeptidyl peptidase-4\
