    uuid: 00000000-0000-4000-8000-000000001119
  - description: Female contraception criterion
    id: EligibilityCriterion_3
    identifier: '3'
    instanceType: EligibilityCriterion
    label: ''
    name: INC3
    text: "<ul>\n  <li>\n    [3a] women of childbearing potential who are abstinent\
      \ (if this is complete\n    abstinence, as their preferred and usual lifestyle)\
      \ or in a same sex\n    relationship (as part of their preferred and usual lifestyle)\
      \ must agree to\n    either remain abstinent or stay in a same sex relationship\
      \ without sexual\n    relationships with males. Periodic abstinence (eg, calendar,\
      \ ovulation,\n    symptothermal, post-ovulation methods), declaration of abstinence\
      \ just for\n    the duration of a trial, and withdrawal are not acceptable methods\
      \ of\n    contraception.\n  </li>\n  <li>\n    [3b] otherwise, women of childbearing\
      \ potential participating must agree to use\n    one highly effective method\
      \ (less than 1% failure rate) of contraception, or a\n    combination of 2 effective\
      \ methods of contraception for the entirety of the\n    study.\n    <ul>\n \
      \     <li>[A] women of childbearing potential participating must test negative\
      \ for\n        pregnancy prior to initiation of treatment as indicated by a\
      \ negative serum\n        pregnancy test at the screening visit followed by\
      \ a negative urine\n        pregnancy test within 24 hours prior to exposure.</li>\n\
      \      <li>[B] either one highly effective method of contraception or a combination\n\
      \        of 2 effective methods of contraception will be used. The patient may\n\
      \        choose to use a double barrier method of contraception. Barrier protection\n\
      \        methods without concomitant use of a spermicide are not a reliable\
      \ or\n        acceptable method. Thus, each barrier method must include use\
      \ of a\n        spermicide. It should be noted that the use of male and female\
      \ condoms\n        as a double barrier method is not considered acceptable due\
      \ to the high\n        failure rate when these methods are combined.</li>\n\
      \    </ul>\n  </li>\n  <li>\n    [3c] women not of childbearing potential may\
      \ participate, and include those who are:\n    <ul>\n      <li>\n        [A]\
      \ infertile due to surgical sterilization (hysterectomy, bilateral\n       \
      \ oophorectomy, or tubal ligation), congenital anomaly such as mullerian\n \
      \       agenesis\n      </li>\n      <li>\n        Or\n        [B] postmenopausal,\
      \ defined as either:\n        <ul>\n          <li>[i] a woman at least 50 years\
      \ of age with an intact uterus, not on hormone therapy, who has had either:\n\
      \          </li>\n          <ul>\n            <li>[a] cessation of menses for\
      \ at least 1 year, or</li>\n            <li>[b] at least 6 months of spontaneous\
      \ amenorrhea with a follicle-stimulating hormone >40 mIU/mL; or</li>\n     \
      \     </ul>\n          <li>[ii] a woman 55 or older not on hormone therapy,\
      \ who has had at least 6 months of spontaneous amenorrhea,\n            or</li>\n\
      \          <li>[iii] a woman at least 55 years of age with a diagnosis of menopause\
      \ prior to starting hormone replacement\n            therapy</li>\n        </ul>\n\
      \      </li>\n    </ul>\n  </li>\n</ul>"
    uuid: 00000000-0000-4000-8000-000000001121
