  - id: NarrativeContent_7
    instanceType: NarrativeContent
    name: SECTION 3.2.
    sectionNumber: 3.2.
    sectionTitle: Background
    text: '<div><p>Hypoglycemia is a common complication in all patients with T1DM
      and some patients with T2DM who use insulin to reduce blood glucose levels.
      Use of sulfonylurea and glinide by patients with T2DM may also cause hypoglycemia.
      Depending on the severity, hypoglycemia causes physical symptoms ranging from
      weakness, dizziness, and sweating progressing to blurred vision, behavioral
      changes, progressing to unconsciousness, seizures, and coma, and possibly to
      death (American Diabetes Association 2017). When emergency services are available
      in a timely manner, intravenous (IV) glucose supplementation is also an effective
      treatment. Glucagon for injection is a globally available product currently
      indicated for the treatment of severe hypoglycemia, and is another important
      treatment option outside of a clinical setting for people who try to rescue
      patients with severe hypoglycemia. However, for people without enough medical
      training, the multi-step reconstitution of glucagon and injection procedure
      would be complex and daunting with substantial risk of errors (Polonsky et al.
      2016). Therefore the needle-free and easy-to-administer formulation of glucagon
      is desired for patients who have a risk of severe hypoglycemia related to anti-diabetes
      treatments. LY900018 is a powder formulation of synthetic human glucagon in
      a user-friendly, single-use, nasal dosing</p>

      <p>device which delivers 3 mg glucagon powder. Patients do not need to inhale,
      as the drug is absorbed from the nasal cavity.</p>

      <p>Three clinical trials using LY900018 have been completed in non-Japanese
      adults with T1DM and T2DM: Study IGBC, Study I8R-MC-IGBA (IGBA), and an actual
      use study (Study I8R-MC-B002 [B002]). Studies IGBC and IGBA demonstrated comparable
      safety and efficacy between 3 mg LY900018 and 1 mg injectable glucagon in reversing
      insulin-induced hypoglycemia in adult patients with T1DM only (Study IGBA) or
      patients with T2DM and T1DM (IGBC). Study B002 was an actual use study that
      evaluated the effectiveness of 3 mg LY900018 administered by a trained caregiver
      to patients with T1DM experiencing moderate to severe hypoglycemia in a real-world
      environment of work and home. Study B002 demonstrated that 96% of moderate to
      severe hypoglycemic events were resolved within 30 minutes. Finally, 2 trials
      were conducted in pediatric patients with T1DM: Study I8R-MC-IGBB (IGBB) and
      Study I8R-MC-B001 (B001). Studies IGBB and B001 demonstrated effectiveness in
      rescuing pediatric patients from hypoglycemia.</p>

      <p>All adult diabetic patients in the 2 inpatient clinical trials (Studies IGBA
      and IGBC) underwent hypoglycemia induction through IV insulin under close clinical
      supervision and were administered either LY900018 or injectable glucagon.</p>

      <p>Patients fully recovered from hypoglycemia without additional actions to
      increase glucose level. Specifically, in Study IGBC, at 30 minutes after glucagon
      dosing, 98.7% (74 out of 75 patients) of LY900018 and 100% (75 out of 75) of
      IMG-treated patients achieved treatment success (defined as an increase in PG
      to &gt;70 mg/dL or an increase of &gt;20 mg/dL from nadir). The nadir is defined
      as the minimum glucose measurement at the time of or within 10 minutes following
      glucagon administration. The LY900018-treated patient who did not meet the above
      criteria did achieve both PG &gt;70 mg/dL and an increase of &gt;20 mg/dL from
      nadir at 40 minutes after dosing. Furthermore, the mean time to treatment success
      in participants with nadir glucose &lt;50 mg/dL were 16 minutes in the LY900018
      treatment arm and 13 minutes in the IMG treatment arm, respectively (Rickels
      et al. 2016).</p></div>'
    uuid: 00000000-0000-4000-8000-000000001381
  - id: NarrativeContent_8
    instanceType: NarrativeContent
    name: SECTION 3.3.
    sectionNumber: 3.3.
    sectionTitle: Benefit/Risk Assessment
    text: "<div><p>There is no anticipated therapeutic benefit for the patients participating\
      \ in this study.</p>\n<p>This study will expose patients to an insulin-induced\
      \ hypoglycemia meant to simulate hypoglycemia in a controlled\n  setting. The\
      \ procedure of insulin-induced hypoglycemia targeting nadir glucose around 50\
      \ mg/dL is adopted from a\n  previously completed trial, specifically Study\
      \ IGBC, which demonstrated the safe use of this method. This is an\n  inpatient\
      \ procedure in which the patients will be under constant supervision of the\
      \ clinical research unit (CRU) staff\n  with frequent glucose monitoring. Safety\
      \ provisions have been considered in that IV glucose will be administered if\n\
      \  the patient experiences signs and symptoms of severe hypoglycemia and gauged\
      \ to require intervention during the\n  experimental procedure, at the discretion\
      \ of the investigator.</p>\n<p>Potential risks associated with LY900018, derived\
      \ from the known risks of currently existing injected glucagon\n  therapy and\
      \ from the safety profile observed from clinical trials conducted for LY900018,\
      \ include nausea, vomiting,\n  allergic reactions, increased blood pressure\
      \ (BP) and heart rate, headache, dysgeusia, and nasal or ocular events\n  (Glucagon\
      \ G Novo for Injection Package Insert, 2016; Glucagon G Novo for Injection Interview\
      \ Form, 2015; GLUCAGON for\n  Injection ITO Package Insert, 2016; GLUCAGON for\
      \ Injection ITO Interview Form, 2016).</p>\n<p><u>Nausea and Vomiting:</u> Glucagon\
      \ therapy, including LY900018, may cause nausea and vomiting.</p>\n<p><u>Allergic\
      \ Reactions:</u> Severe, life-threatening, generalized allergy, including anaphylaxis,\
      \ can occur with glucagon\n  therapy, including LY900018. Patients who have\
      \ had hypersensitivity reactions to injectable glucagon, or LY900018 or\n  any\
      \ of its excipients will be excluded from all clinical studies.</p>\n<p><u>Increased\
      \ Blood Pressure and Heart Rate:</u> Glucagon exerts positive inotropic and\
      \ chronotropic effects. A temporary\n  increase in both BP and heart rate may\
      \ occur after the administration of glucagon, including LY900018.</p>\n<p><u>Headache\
      \ and Dysgeusia:</u> Use of LY900018 may cause headache and altered taste.</p>\n\
      <p><u>Nasal Symptoms:</u> Use of LY900018 may cause a variety of nasal symptoms,\
      \ such as runny nose, stuffy nose, nasal\n  discomfort, cough, and sneezing.</p>\n\
      <p><u>Ocular Symptoms:</u> Use of LY900018 may cause a variety of ocular symptoms,\
      \ such as watery eyes, redness of eyes, and\n  itchy eyes.</p>\n<p>No additional\
      \ potential risks of LY900018 were identified in preclinical safety pharmacology\
      \ and toxicity studies\n  (Reno et al. 2015).</p>\n<p>More information about\
      \ the known and expected benefits, risks, serious adverse events (SAEs), and\
      \ reasonably\n  anticipated adverse events (AEs) of LY900018 are to be found\
      \ in the Investigator\u2019s Brochure (IB).</p>\n<p>More detailed information\
      \ about the known and expected benefits and risks of GlucaGen \xAE be found\
      \ in the Summary of\n  Product Characteristics (GlucaGen Summary of Product\
      \ Characteristics, 2015).</p></div>"
    uuid: 00000000-0000-4000-8000-000000001382
