  - id: NarrativeContent_10
    instanceType: NarrativeContent
    name: SECTION 5
    sectionNumber: '5'
    sectionTitle: Study Design
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001384
  - id: NarrativeContent_11
    instanceType: NarrativeContent
    name: SECTION 5.1.
    sectionNumber: 5.1.
    sectionTitle: Overall Design
    text: "<div><p>This is a Phase 3, multicenter, randomized, open-label, active\
      \ comparator, single-dose, 2-period, 2-treatment,\n  crossover study in Japanese\
      \ patients with T1DM and T2DM. The study consists of a screening period; treatment\
      \ period 1\n  (Period 1); washout period; treatment period 2 (Period 2); follow-up\
      \ period. Figure IGBJ.1 illustrates the study\n  design. Prior to the study\
      \ drug administration on Period 1 Day 1, patients will be randomly assigned\
      \ to a treatment\n  sequence (either LY900018 in Period 1 and IMG in Period\
      \ 2, or vice versa).</p>\n<p>Safety data will be reviewed after the first 6\
      \ patients (regardless of type of diabetes) are administered LY900018 in\n \
      \ Period 2, and the remaining patients will be dosed after confirmation of the\
      \ safety. The investigator and Lilly\n  clinical research physician (CRP) or\
      \ scientist will review available safety data, including AEs, SAEs, vital signs,\n\
      \  electrocardiograms (ECGs), and safety laboratory tests, from these patients\
      \ after they complete Period 2 Day 1. If no\n  clinically significant safety\
      \ findings for treatment or study procedure are noted, the remaining patients\
      \ will be\n  dosed.</p>\n<p>In each treatment period, patients will undergo\
      \ a procedure to induce hypoglycemia using IV insulin infusion and\n  serial\
      \ blood sampling will be conducted to monitor bedside PG for safety. The insulin\
      \ infusion will be stopped once\n  the PG level reaches &lt;60 mg/dL and approximately\
      \ 5 minutes later patients will be administered either 3 mg LY900018\n  or 1\
      \ mg IMG (GlucaGen). Serial blood sampling will be performed for glucagon (for\
      \ pharmacokinetics [PK]) and PG (for\n  pharmacodynamics [PD]) concentration\
      \ measurements immediately before and up to 4 hours following the administration\
      \ of\n  glucagon. In each period, patients will remain in the CRU for at least\
      \ 6 hours after glucagon administration. All\n  patients will receive a carbohydrate-rich\
      \ meal prior to discharge. Patients may stay longer as needed, at the\n  discretion\
      \ of the investigator.</p>\n<p>Study governance considerations are described\
      \ in detail in Appendix 3.</p>\n\n<div class=\"col-md-8 offset-md-2 text-center\"\
      >\n<p class=\"usdm-warning\">Note:</p>\n<p class=\"usdm-warning\">Failed to\
      \ insert image 'design.png', ignoring!</p>\n</div>\n</div>"
    uuid: 00000000-0000-4000-8000-000000001385
  - id: NarrativeContent_12
    instanceType: NarrativeContent
    name: SECTION 5.2.
    sectionNumber: 5.2.
    sectionTitle: Number of Participants
    text: '<div><p>Seventy five (<usdm:ref attribute="maxValue" id="Range_2" klass="Range"></usdm:ref>)
      patients may be enrolled in order to have at

      least <usdm:ref attribute="maxValue" id="Range_1" klass="Range"></usdm:ref>
      patients (at least <usdm:ref attribute="maxValue" id="Range_3" klass="Range"></usdm:ref>
      patients with T1DM and <usdm:ref attribute="maxValue" id="Range_5" klass="Range"></usdm:ref>

      T2DM, respectively) complete the study. For purposes of this study, a

      completer is defined as a patient who completes both periods with evaluable
      primary outcome.

      If patients discontinue from the study before completion of both periods with
      evaluable primary

      outcome for any reason, the patient may be replaced to ensure <usdm:ref attribute="maxValue"
      id="Range_1" klass="Range"></usdm:ref> patients complete the study.

      The replacement patients will be assigned the same treatment sequence as the
      patients to be

      replaced and will complete that treatment sequence in its entirety. Replacement
      should not occur

      beyond <usdm:ref attribute="maxValue" id="Range_2" klass="Range"></usdm:ref>
      patients enrolled, if it is expected to have at

      least <usdm:ref attribute="maxValue" id="Range_1" klass="Range"></usdm:ref>
      patients complete the study.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001386
  - id: NarrativeContent_13
    instanceType: NarrativeContent
    name: SECTION 5.3.
    sectionNumber: 5.3.
    sectionTitle: End of Study Definition
    text: <div><p>End of the study is the date of the last visit or last scheduled
