    uuid: 00000000-0000-4000-8000-000000001387
  - id: NarrativeContent_14
    instanceType: NarrativeContent
    name: SECTION 5.4.
    sectionNumber: 5.4.
    sectionTitle: Scientific Rationale for Study Design
    text: "<div><p>This study design involves an open-label assessment of 3 mg LY900018\
      \ compared to 1 mg of the marketed IMG (GlucaGen). The study will be open label\
      \ because the different administration routes (ie, intranasal and IM) cannot\
      \ be blinded. The use of a crossover design allows each patient to serve as\
      \ his or her own control, thereby reducing variability. The washout period of\
      \ 3 to 14 days is considered sufficient based on the short half-life of LY900018\
      \ (t 1/2 = approximately 25 minutes). Since the critical role of glucagon in\
      \ the treatment of severe hypoglycemia is to raise the PG level sufficiently\
      \ to restore cognition to the point where oral carbohydrate can be ingested,\
      \ treatment success is defined either as an increase in PG returning to normal\
      \ level of \u226570 mg/dL or an increase of \u226520 mg/dL from the PG nadir\
      \ within 30 minutes after receiving glucagon, without the patient receiving\
      \ additional actions to increase glucose. It is believed that an expected PG\
      \ nadir of approximately 50 mg/dL (approximately 5 minutes after stop of insulin\
      \ infusion at 60 mg/dL) is low enough to generate clinical symptoms in most\
      \ participants and is high enough to avoid impairment of consciousness. The\
      \ primary analysis includes both patients with T1DM and T2DM since it is expected\
      \ that the proportion of treatment success is similar between patients with\
      \ T1DM and T2DM.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001388
  - id: NarrativeContent_15
    instanceType: NarrativeContent
    name: SECTION 5.5.
    sectionNumber: 5.5.
    sectionTitle: Justification for Dose
    text: '<div><p>Results from studies in both pediatric and adult populations confirm
      that, while the physiological response to glucagon does appear to saturate between
      the 2- and 3-mg LY900018 doses, the lower 2-mg dose may not always elicit the
      maximum response needed in an emergency situation of severe hypoglycemia. The
      3-mg dose provides more consistent clinical efficacy compared to the 2-mg dose
      and is similarly well tolerated in both pediatric and adult patients.</p>

      <p>The 1-mg dose of IMG is selected as the approved dose for the rescue treatment
      of hypoglycemia in Japan.</p>

      <p>Based on LY900018 exposure, efficacy, and safety, the 3-mg dose was selected
      for the Phase 3 studies. Therefore, in the current study, the 3-mg LY900018
      dose will be used to compare against 1 mg IMG.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001389
  - id: NarrativeContent_16
    instanceType: NarrativeContent
    name: SECTION 6
    sectionNumber: '6'
    sectionTitle: Study Population
    text: '<div><p>Eligibility of patients for the study will be based on the results
      of screening medical history, physical examination, vital signs, clinical laboratory
      tests, and ECG.</p>

      <p>The nature of any conditions present at the time of the physical examination
      and any preexisting conditions will be documented.</p>

      <p>Screening may occur up to 28 days prior to enrollment. Patients who are not
      enrolled within 28 days of screening may be subjected to an additional medical
      assessment and/or clinical measurements to confirm their eligibility.</p>

      <p>Prospective approval of protocol deviations to recruitment and enrollment
      criteria, also known as protocol waivers or exemptions, are not permitted.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001390
