  - id: NarrativeContent_19
    instanceType: NarrativeContent
    name: SECTION 6.3.
    sectionNumber: 6.3.
    sectionTitle: Lifestyle and/or Dietary Requirements
    text: <div><p>Throughout the study, patients may undergo medical assessments and
      review of compliance with requirements before continuing in the study.</p></div>
    uuid: 00000000-0000-4000-8000-000000001393
  - id: NarrativeContent_20
    instanceType: NarrativeContent
    name: SECTION 6.3.1.
    sectionNumber: 6.3.1.
    sectionTitle: Meals and Dietary Restrictions
    text: '<div><p>In both treatment periods, patients will fast for at least 8 hours
      prior to beginning the hypoglycemia induction procedure. Patients should not
      be given any calorie-containing food/drink during insulin-induced hypoglycemia
      and within 90 minutes of glucagon administration unless there is a safety concern.
      The patients will receive a carbohydrate-rich meal after completion of all pharmacokinetic
      (PK) blood sample collections, at 240 minutes post glucagon dose. Patients will
      be given access to calorie-free water up to 240 minutes post study treatment.</p>

      <p>While resident in the CRU, patients should not consume any food or caloric
      drinks other than that provided by the CRU. When not resident in the CRU, patients
      will be encouraged to follow their normal diets.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001394
  - id: NarrativeContent_21
    instanceType: NarrativeContent
    name: SECTION 6.3.2.
    sectionNumber: 6.3.2.
    sectionTitle: Caffeine, Alcohol, and Tobacco
    text: <div><p>Patients should refrain from caffeine-containing food/beverages
      (eg, cola, chocolate drinks, tea, and coffee) from Day -1 to discharge from
      CRU in each period. Patient alcohol intake should not exceed 21 units per week
      (males up to age 65) and 14 units per week (males over 65 and females) during
      the study. Patients must not consume alcohol from Day -2 to discharge from CRU
      in each period. Smoking will not be permitted when resident in the CRU.</p></div>
    uuid: 00000000-0000-4000-8000-000000001395
  - id: NarrativeContent_22
    instanceType: NarrativeContent
    name: SECTION 6.3.3.
    sectionNumber: 6.3.3.
    sectionTitle: Activity
    text: '<div><p>Patients are encouraged to maintain their regular exercise habits
      for the duration of the study. However, patients should avoid strenuous exercise
      48 hours prior to admission or study visit.</p>

      <p>From the beginning of hypoglycemia induction to 240 minutes post study treatment,
      patients should remain recumbent or sitting on the bed.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001396
  - id: NarrativeContent_23
    instanceType: NarrativeContent
    name: SECTION 6.3.4.
    sectionNumber: 6.3.4.
    sectionTitle: Contraception
    text: '<div><p>Male patients must use an effective method of contraception for
      the duration of the study and for 28 days following the last study treatment.</p>

      <p>Female patients of childbearing potential must use one highly effective method
      of contraception (&lt;1% failure rate; such as combined oral contraceptive pill,
      implanted contraceptives, or intrauterine device) or a combination of 2 effective
      methods of contraception (such as male or female condoms with spermicide [not
      approved in Japan], diaphragms with spermicide [not approved in Japan], or cervical
      sponges) during the study and for 28 days following the last study treatment.
      The patient may choose to use a double barrier method of contraception. Barrier
      protection methods without concomitant use of a spermicide are not a reliable
      or acceptable method. Thus, each barrier method must include use of a spermicide.
      It should be noted that the use of male and female condoms as a double barrier
      method is not considered acceptable due to the high failure rate when these
      methods are combined.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001397
  - id: NarrativeContent_24
    instanceType: NarrativeContent
    name: SECTION 6.4.
    sectionNumber: 6.4.
    sectionTitle: Screen Failures
    text: <div><p>Individuals who do not meet the criteria for participation in this
      study (screen failure) may not be re-screened.</p></div>
    uuid: 00000000-0000-4000-8000-000000001398
  - id: NarrativeContent_25
    instanceType: NarrativeContent
    name: SECTION 7
    sectionNumber: '7'
    sectionTitle: Treatment
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001399
  - id: NarrativeContent_26
    instanceType: NarrativeContent
    name: SECTION 7.1.
    sectionNumber: 7.1.
    sectionTitle: Treatment Administered
    text: '<div><p>This study involves a comparison of 3 mg of LY900018 administered
      once nasally to 1 mg glucagon administered IM (comparator). Table IGBJ.2 shows
      the study treatment information.</p>

      <p><b>Table IGBJ.2. Study Treatments</b></p>

      <table class="table">

      <tr>

      <th><p>Treatment Name</p></th>

      <td><p><usdm:ref attribute="label" id="StudyIntervention_1" klass="StudyIntervention"></usdm:ref></p></td>

      <td><p><usdm:ref attribute="label" id="StudyIntervention_2" klass="StudyIntervention"></usdm:ref></p></td>

      </tr>

      <tr>

      <th><p>Dosage Formulation</p></th>

      <td><p>Dry powder</p></td>

      <td><p>Dry powder</p></td>

      </tr>

      <tr>

      <th><p>Dosage Levels  </p></th>

      <td><p><usdm:ref attribute="value" id="Quantity_3" klass="Quantity"></usdm:ref>
      <usdm:ref attribute="decode" id="Code_474" klass="Code"></usdm:ref> glucagon</p></td>

      <td><p><usdm:ref attribute="value" id="Quantity_6" klass="Quantity"></usdm:ref>
      <usdm:ref attribute="decode" id="Code_484" klass="Code"></usdm:ref> glucagon</p></td>

      </tr>

      <tr>

      <th><p>Route of Administration</p></th>

      <td><p><usdm:ref attribute="decode" id="Code_473" klass="Code"></usdm:ref></p></td>

      <td><p><usdm:ref attribute="decode" id="Code_483" klass="Code"></usdm:ref></p></td>

      </tr>

      <tr>

      <th>Dosing Instructions</th>

      <td><usdm:ref attribute="description" id="AgentAdministration_1" klass="AgentAdministration"></usdm:ref></td>

      <td><usdm:ref attribute="description" id="AgentAdministration_2" klass="AgentAdministration"></usdm:ref></td>

      </tr>

      </table>

      <p>The procedure for insulin-induced hypoglycemia will require an IV infusion
      of diluted human regular insulin (0.3 U/mL by diluting 15 U human regular insulin
      [100 U/mL] into 50 mL saline). Details regarding hypoglycemia induction and
      glucagon administration procedures are included in Sections 9.2.1 and 9.2.2,
      respectively.</p>

      <p>The investigator or designee is responsible for:</p>

      <ul>

      <li><p>explaining the correct use of the investigational products to the site
      personnel</p></li>

      <li><p>verifying that instructions are followed properly</p></li>

      <li><p>maintaining accurate records of investigational product dispensing and
      collection</p></li>

      <li><p>and returning all unused medication to Lilly or its designee at the end
      of the study</p></li>

      </ul></div>'
    uuid: 00000000-0000-4000-8000-000000001400
  - id: NarrativeContent_27
    instanceType: NarrativeContent
    name: SECTION 7.1.1.
    sectionNumber: 7.1.1.
    sectionTitle: Packaging and Labeling
    text: "<div><p>Clinical trial materials will be labeled according to the country\u2019\
      s regulatory requirements. Lilly will supply LY900018 and GlucaGen to the clinical\
      \ site. Study materials will be provided as open-label material.</p>\n<p>Investigational\
      \ products must be stored at the investigational site, according to the instructions\
      \ provided on the product label, in a locked and secure place.</p>\n<p>Unused\
      \ investigational products will remain locked and securely stored, according\
      \ to the instructions provided on the product label at the investigational site,\
      \ until returned to the sponsor or its designee, according to written instruction\
      \ from the sponsor.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001401
  - id: NarrativeContent_28
    instanceType: NarrativeContent
    name: SECTION 7.1.2.
    sectionNumber: 7.1.2.
    sectionTitle: Medical Devices
    text: <div><p>The manufactured drug product provided for use in the study includes
      a nasal delivery device as part of the investigational drug product. The device
      component of the investigational drug product is inserted into the nasal cavity
      to deliver the contained drug constituent.</p></div>
    uuid: 00000000-0000-4000-8000-000000001402
  - id: NarrativeContent_29
    instanceType: NarrativeContent
    name: SECTION 7.2.
    sectionNumber: 7.2.
    sectionTitle: Method of Treatment Assignment
    text: <div><p>The treatment sequence to be administered for each enrolled patient
      will be determined according to a randomization table.</p></div>
    uuid: 00000000-0000-4000-8000-000000001403
  - id: NarrativeContent_30
    instanceType: NarrativeContent
    name: SECTION 7.2.1.
    sectionNumber: 7.2.1.
    sectionTitle: Selection and Timing of Doses
    text: "<div><p>The hypoglycemia induction procedure should be initiated at approximately\
      \ the same time at each treatment visit. Insulin IV infusion will be given until\
      \ PG is &lt;60 mg/dL. At this point, insulin infusion will be stopped and, approximately\
      \ 5 minutes later, a single glucagon dose (LY900018 or IMG) will be administered.\
      \ The doses will be administered at approximately the same times on each day.\
      \ The actual time of all dose administrations will be recorded in the patient\u2019\
      s case report form (CRF).</p></div>"
    uuid: 00000000-0000-4000-8000-000000001404
  - id: NarrativeContent_31
    instanceType: NarrativeContent
    name: SECTION 7.3.
    sectionNumber: 7.3.
    sectionTitle: Blinding
    text: "<div><p>This is an open-label study. However, the treatment assignment\
      \ list for all randomized patients will not be shared with those responsible\
      \ for doing either the treatment response assessments or making the decision\
      \ to take additional action to raise patients\u2019 PG concentrations post-glucagon\
      \ administration. The intent is to minimize any potential bias in administering\
      \ additional rescue treatment for hypoglycemia.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001405
  - id: NarrativeContent_32
    instanceType: NarrativeContent
    name: SECTION 7.4.
    sectionNumber: 7.4.
    sectionTitle: Dose Modification
    text: <div><p>Not applicable.</p></div>
    uuid: 00000000-0000-4000-8000-000000001406
  - id: NarrativeContent_33
    instanceType: NarrativeContent
    name: SECTION 7.5.
    sectionNumber: 7.5.
    sectionTitle: Preparation/Handling/Storage/Accountability
    text: '<div><p>The investigator or designee must confirm appropriate temperature
      conditions have been maintained, as communicated by the sponsor, during transit
      for all investigational product received and any discrepancies are reported
      and resolved before use of the study treatment.</p>

      <p>Only participants enrolled in the study may receive investigational product
      or study materials, and only authorized site staff may supply or administer
      investigational product. All investigational products should be stored in an
      environmentally-controlled and monitored (manual or automated) area in accordance
      with the labeled storage conditions with access limited to the investigator
      and authorized site staff.</p>

      <p>The investigator, institution, or the head of the medical institution (where
      applicable) is responsible for study treatment accountability, reconciliation,
      and record maintenance (such as receipt, reconciliation, and final disposition
      records).</p></div>'
    uuid: 00000000-0000-4000-8000-000000001407
  - id: NarrativeContent_34
    instanceType: NarrativeContent
    name: SECTION 7.6.
    sectionNumber: 7.6.
    sectionTitle: Treatment Compliance
    text: <div><p>The investigational product will be administered at the clinical
      site, and documentation of treatment administration will occur at the site.</p></div>
    uuid: 00000000-0000-4000-8000-000000001408
  - id: NarrativeContent_35
    instanceType: NarrativeContent
    name: SECTION 7.7.
    sectionNumber: 7.7.
    sectionTitle: Concomitant Therapy
    text: '<div><p>Patients on stable concomitant medication at the time of study
      entry should continue their regular, unchanged dose throughout the study. These
      medications include stable regimen for 3 months of the anti-hyperglycemic therapy
      (for example, insulins and OAMs) as well as anti-hypertensive and anti-lipidemic
      medications. In addition to the physical examination, investigators should review
      the insulin regimen for all patients enrolled into the study to confirm acceptability
      to undergo the procedure to induce hypoglycemia (see Schedule of Activities;
      Section 2).</p>

      <p>For patients using basal insulin, the last basal insulin injection should
      occur no later than 12 hours prior to the insulin-induced hypoglycemia procedure,
      and the basal dose should not be changed. Patients may inject basal insulin
      any time after the last PK sample is collected on Day 1 in each period.</p>

      <p>For patients using prandial insulin, the last prandial insulin injection
      should occur no later than 6 hours prior to the insulin-induced hypoglycemia
      procedure. Patients may inject prandial insulin after the last PK sample is
      collected and before the meal on Day 1 in each period. The first prandial insulin
      dose for an individual patient after insulin-induced hypoglycemia procedure
      should be determined by the investigator based on the PG before meal and carbohydrate
      intake.</p>

      <p>For patients using an insulin pump, a continuous subcutaneous insulin infusion
      by pump should be discontinued prior to procedure to induce hypoglycemia. Patients
      may start subcutaneous insulin infusion after the last PK sample is collected
      and before the meal on Day 1 in each period. The insulin dose should be determined
      by the investigator based on the PG before meal and carbohydrate intake.</p>

      <p>For patients using OAMs, the last dose should occur no later than 12 hours
      prior to the insulin-induced hypoglycemia procedure. Patients may start OAM
      after the last PK sample is collected on Day 1 in each period.</p>

      <p>The following concomitant medications are prohibited to use during the course
      of the study: beta-blocker, indomethacin, warfarin, and anti-cholinergic drugs.</p>

      <p>The following concomitant medications that affect gastric motility can be
      used during the study but should be washed out before 7 days of each period
      and not taken while in the CRU: pro-motility medications (eg, metoclopramide,
      domperidone), opiate medications (eg, morphine), and medications with anti-emetic
      effects (eg, promethazine, prochlorperazine).</p>

      <p>In general, concomitant medication should be avoided; however, acetaminophen
      (1 g, maximum 2 g/24 hours) may be administered at the discretion of the investigator
      for treatment of headaches, etc. If the need for concomitant medication (other
      than acetaminophen) arises, inclusion or continuation of the patients may be
      at the discretion of the investigator after consultation with a Lilly clinical
      pharmacologist (CP) or CRP. Any medication used during the course of the study
      must be documented.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001409
  - id: NarrativeContent_36
    instanceType: NarrativeContent
    name: SECTION 7.8.
    sectionNumber: 7.8.
    sectionTitle: Treatment after the End of the Study
    text: <div><p>Patients will continue their previous insulin regimen after the
      study procedure has been completed.</p></div>
    uuid: 00000000-0000-4000-8000-000000001410
  - id: NarrativeContent_37
    instanceType: NarrativeContent
    name: SECTION 8
    sectionNumber: '8'
    sectionTitle: Discontinuation Criteria
    text: <div><p>Patients discontinuing from the study prematurely for any reason
      must complete AE and follow-up procedures as shown in the Schedule of Activities
      (Section 2).</p></div>
    uuid: 00000000-0000-4000-8000-000000001411
  - id: NarrativeContent_38
    instanceType: NarrativeContent
    name: SECTION 8.1.
    sectionNumber: 8.1.
    sectionTitle: Discontinuation from Study Treatment
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001412
  - id: NarrativeContent_39
    instanceType: NarrativeContent
    name: SECTION 8.1.1.
    sectionNumber: 8.1.1.
    sectionTitle: Discontinuation of Inadvertently Enrolled Patients
    text: <div><p>If the sponsor or investigator identifies a patient who did not
      meet enrollment criteria and was inadvertently enrolled, a discussion must occur
      between the Lilly CP/CRP and the investigator to determine if the patient may
      continue in the study. If both agree it is medically appropriate to continue,
      the investigator must obtain documented approval from the Lilly CP/CRP to allow
      the inadvertently enrolled patient to continue in the study with or without
      continued treatment with investigational product.</p></div>
    uuid: 00000000-0000-4000-8000-000000001413
  - id: NarrativeContent_40
    instanceType: NarrativeContent
    name: SECTION 8.2.
    sectionNumber: 8.2.
    sectionTitle: Discontinuation from the Study
    text: '<div><p>Patients will be discontinued in the following circumstances:</p>

      <ul>

      <li>

      <p>enrollment in any other clinical study involving an investigational product
      or enrollment in any other type of medical research judged not to be scientifically
      or medically compatible with this study</p>

      </li>

      <li>

      <p>participation in the study needs to be stopped for medical, safety, regulatory,
      or other reasons consistent with applicable laws, regulations, and good clinical
      practice</p>

      </li>

      <li>

      <p>investigator decision</p>

      <ul>

      <li>

      <p>the investigator decides that the patient should be discontinued from the
      study for any reason. If this decision is made because of an AE, SAE, or a severe
      hypoglycemia event, appropriate measures are to be taken. Lilly or its designee
      is to be alerted.</p>

      </li>

      </ul>

      </li>

      <li>

      <p>patient decision</p>

      <ul>

      <li>

      <p>the patient, or legal representative, requests to be withdrawn from the study</p>

      </li>

      </ul>

      </li>

      </ul></div>'
    uuid: 00000000-0000-4000-8000-000000001414
  - id: NarrativeContent_41
    instanceType: NarrativeContent
    name: SECTION 8.3.
    sectionNumber: 8.3.
    sectionTitle: Discontinuation of the Study
    text: <div><p>Following the review of the safety data from the first 6 patients
      to complete Period 2 Day 1, the study will be stopped if deemed necessary for
      patient safety in the opinion of the Investigator and sponsor (Section 10.3.7).</p></div>
    uuid: 00000000-0000-4000-8000-000000001415
  - id: NarrativeContent_42
    instanceType: NarrativeContent
    name: SECTION 8.4.
    sectionNumber: 8.4.
    sectionTitle: Patients Lost to Follow-up
    text: <div><p>A patient will be considered lost to follow-up if he or she repeatedly
      fails to return for scheduled visits and is unable to be contacted by the study
      site. Site personnel are expected to make diligent attempts to contact patients
      who fail to return for a scheduled visit or were otherwise unable to be followed
      up by the site.</p></div>
    uuid: 00000000-0000-4000-8000-000000001416
  - id: NarrativeContent_43
    instanceType: NarrativeContent
    name: SECTION 9
    sectionNumber: '9'
    sectionTitle: Study Assessments and Procedures
    text: '<div><p>Section 2 lists the Schedule of Activities, detailing the study
      procedures and their timing.</p>

      <p>Appendix 2 lists the laboratory tests that will be performed for this study.</p>

      <p>Appendix 5 provides a summary of the maximum number and volume of invasive
      samples, for all sampling, during the study.</p>

      <p>Unless otherwise stated in subsections below, all samples collected for specified
      laboratory tests will be destroyed within 60 days of receipt of confirmed test
      results. Certain samples may be retained for a longer period, if necessary,
      to comply with applicable laws, regulations, or laboratory certification standards.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001417
  - id: NarrativeContent_44
    instanceType: NarrativeContent
    name: SECTION 9.1.
    sectionNumber: 9.1.
    sectionTitle: Efficacy Assessments
    text: <div><p>Plasma glucose levels will be measured as described in Section 9.2.3
      and will be used to assess efficacy outcomes.</p></div>
    uuid: 00000000-0000-4000-8000-000000001418
  - id: NarrativeContent_45
    instanceType: NarrativeContent
    name: SECTION 9.1.1.
    sectionNumber: 9.1.1.
    sectionTitle: Primary Efficacy Assessments
    text: '<div><p>The primary efficacy measure is the proportion of patients achieving
      treatment success, defined<br/>

      as either an increase in PG to &gt;70 mg/dL or an increase of &gt;20 mg/dL from
      nadir within<br/>

      30 minutes after administration of glucagon.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001419
  - id: NarrativeContent_46
    instanceType: NarrativeContent
    name: SECTION 9.1.2.
    sectionNumber: 9.1.2.
    sectionTitle: Secondary Efficacy Assessments
    text: <div><p>Secondary efficacy measures will be determined from the pharmacodynamic
      (PD) characterization of PG profiles, including evaluation of change from baseline
      PG concentrations.</p></div>
    uuid: 00000000-0000-4000-8000-000000001420
  - id: NarrativeContent_47
    instanceType: NarrativeContent
    name: SECTION 9.1.3.
    sectionNumber: 9.1.3.
    sectionTitle: Exploratory Efficacy Assessments
    text: '<div><p>Subjective hypoglycemia symptoms will be assessed using a self-reported
      assessment tool (Edinburgh Hypoglycemia Scale; Appendix 7) during the initiation
      of the hypoglycemia induction, as well as at various time points following the
      administration of either LY900018 or IMG (see Schedule of Activities; Section
      2).</p>

      <p>The ability of the patient to identify hypoglycemic symptoms and describe
      their frequency will be captured at Period 1 Day -1 (see Schedule of Activities;
      Section 2). This self-report assessment will be done using the Clarke Hypoglycemia
      Awareness Survey (Appendix 8).</p></div>'
    uuid: 00000000-0000-4000-8000-000000001421
  - id: NarrativeContent_48
    instanceType: NarrativeContent
    name: SECTION 9.2.
    sectionNumber: 9.2.
    sectionTitle: Procedures
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001422
  - id: NarrativeContent_49
    instanceType: NarrativeContent
    name: SECTION 9.2.1.
    sectionNumber: 9.2.1.
    sectionTitle: Insulin-induced Hypoglycemia
    text: "<div><p>A study investigator, or qualified designee, must be present at\
      \ the bedside for clinical assessments of the patient during the insulin infusion\
      \ and for the 120 minutes following the glucagon administration.</p>\n<p>The\
      \ bedside PG level, measured using a glucose analyzer (Antsense Duo, HORIBA\
      \ Ltd. or equivalent), must be 90 to 250 mg/dL to start the procedure. If the\
      \ bedside PG is outside of this range, the hypoglycemia induction should be\
      \ rescheduled.</p>\n<p>Hypoglycemia will be induced by IV infusion of diluted\
      \ human regular insulin (0.3 U/mL) at a rate of 2 mU/kg/min. The infusion rate\
      \ may be adjusted as necessary up to a rate of 3 mU/kg/min for T1DM or 4 mU/kg/min\
      \ for T2DM to decrease bedside PG levels &lt;60 mg/dL; however, the rate of\
      \ decrease in PG should not exceed 50 mg/dL per 30 minutes. When the bedside\
      \ PG concentration reaches &lt;90 mg/dL, the insulin infusion rate may be decreased\
      \ to approximately 1.0 mU/kg/min at the investigator\u2019s discretion. Once\
      \ the bedside PG level is &lt;60 mg/dL, the insulin infusion will be stopped.\
      \ If the target bedside PG level cannot be achieved within 4 hours after the\
      \ start of insulin infusion, the hypoglycemia induction procedure will be terminated\
      \ before glucagon administration, and the patient may have a carbohydrate-rich\
      \ meal and be discharged from the CRU after medical assessment. Additional safety\
      \ assessments may be conducted at the investigator\u2019s discretion. The patient\
      \ may be rescheduled for a new dosing visit 1 to 7 days later.</p>\n<p>For safety\
      \ monitoring during the hypoglycemia induction procedure, bedside PG levels\
      \ will be measured using the glucose analyzer no more than 10 minutes apart\
      \ while PG is &gt;90 mg/dL, and no more than 5 minutes apart when PG is &lt;90\
      \ mg/dL.</p>\n<p>Blood samples will be collected at pre-hypoglycemia induction\
      \ and end of insulin infusion (5 minutes prior to study treatment) for PG (PD,\
      \ as measured by central laboratory) and/or glucagon (PK) measurements according\
      \ to the Schedule of Activities (Section 2).</p></div>"
    uuid: 00000000-0000-4000-8000-000000001423
  - id: NarrativeContent_50
    instanceType: NarrativeContent
    name: SECTION 9.2.2.
    sectionNumber: 9.2.2.
    sectionTitle: Glucagon Administration
    text: <div><p>Approximately 5 minutes after the insulin infusion has stopped,
      glucagon (either 3 mg LY900018 or 1 mg IMG) will be administered according to
      randomization. Refer to Section 7 for details regarding treatments.</p></div>
    uuid: 00000000-0000-4000-8000-000000001424
  - id: NarrativeContent_51
    instanceType: NarrativeContent
    name: SECTION 9.2.2.1.
    sectionNumber: 9.2.2.1.
    sectionTitle: Nasal LY900018 Administration
    text: '<div><p> LY900018 will be administered by CRU staff with the patient lying
      in a fully reclined lateral position on the opposite side of the nostril being
      administered (ie, dose is given in the left nostril of a patient lying in right
      lateral recumbency).</p>

      <p>The tip of the drug product is gently entered in the nostril to the point
      where the index and middle finger of the administrator are just touching the
      external nare of the patient. At that point, the bottom of the drug product
      is pushed with the thumb until the device is engaged, the green band disappears,
      and powder is discharged into the nostril. The drug is absorbed from the nasal
      cavity; thus, the patient does not need to inhale after dosing and continues
      breathing normally throughout the process. If a patient sneezes immediately
      after administration, document using the Nasal and Non-nasal Score Questionnaire
      (see Appendix 6 for a copy of the questionnaire).</p></div>'
    uuid: 00000000-0000-4000-8000-000000001425
  - id: NarrativeContent_52
    instanceType: NarrativeContent
    name: SECTION 9.2.2.2.
    sectionNumber: 9.2.2.2.
    sectionTitle: Intramuscular Glucagon Administration
    text: "<div><p>\nGlucaGen 1 mg for injection will be used as a comparator. The\
      \ lyophilized 1 mg glucagon will\nbe reconstituted with 1.1 mL diluent according\
      \ to the instruction. A dose of 1 mg of glucagon in</p>\n<p>a concentration\
      \ of 1 mg/mL will be injected in the deltoid muscle of the patient\u2019s nondominant\
      \ arm with the patient lying in a fully reclined lateral position on the opposite\
      \ side of the arm being administered (ie, dose is given in the left arm of a\
      \ patient lying in right lateral recumbency if right arm is the dominant arm).</p></div>"
    uuid: 00000000-0000-4000-8000-000000001426
  - id: NarrativeContent_53
    instanceType: NarrativeContent
    name: SECTION 9.2.3.
    sectionNumber: 9.2.3.
    sectionTitle: Post Glucagon Administration
    text: '<div><p>For 120 minutes after glucagon administration, bedside PG levels
      will be measured no more than<br/>

      5 minutes apart when the PG is &lt;90 mg/dL, and no more than 10 minutes apart
      when PG is<br/>

      &gt;90 mg/dL using a glucose analyzer (Antsense Duo, HORIBA Ltd. or equivalent).</p>

      <p>Blood samples will be collected at predose and various time points post glucagon
      administration for PG (PD, as measured by central laboratory) and/or glucagon
      (PK) measurements according to the Schedule of Activities (Section 2).</p>

      <p>To accurately capture the PG profile, the site should not give patients any
      calorie-containing food/drink within 90 minutes of glucagon administration unless
      there is a safety concern.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001427
  - id: NarrativeContent_54
    instanceType: NarrativeContent
    name: SECTION 9.2.4.
    sectionNumber: 9.2.4.
    sectionTitle: 'Procedures for Insufficient Response to Glucagon

      Administration'
    text: "<div><p>If the patient loses consciousness or the bedside PG is declining\
      \ too fast or symptoms consistent with the progression to severe hypoglycemia\
      \ occur, the investigator may decide to start a glucose infusion to prevent\
      \ a deterioration of the situation. Following the administration of glucagon,\
      \ if a patient\u2019s bedside PG concentration remains &lt;55 mg/dL at 30 minutes\
      \ or &lt;60 mg/dL at 45 minutes postdose, IV glucose may be given as deemed\
      \ clinically necessary. If IV glucose is given, the time and amount of glucose\
      \ infusion will be recorded in the CRF.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001428
  - id: NarrativeContent_55
    instanceType: NarrativeContent
    name: SECTION 9.2.5.
    sectionNumber: 9.2.5.
    sectionTitle: End of Admission
    text: <div><p>Before discharge from the CRU, the glucose and insulin dosing and
      stability of the patient will be evaluated by the investigator to ensure patient
      safety. Patients will remain at the CRU for at least 6 hours following glucagon
      administration, during which time a carbohydrate-rich meal will be provided.
      The patient may stay at the CRU longer, at the discretion of the investigator.</p></div>
    uuid: 00000000-0000-4000-8000-000000001429
  - id: NarrativeContent_56
    instanceType: NarrativeContent
    name: SECTION 9.3.
    sectionNumber: 9.3.
    sectionTitle: Adverse Events
    text: "<div><p>Investigators are responsible for monitoring the safety of patients\
      \ who have entered this study and for alerting Lilly or its designee to any\
      \ event that seems unusual, even if this event may be considered an unanticipated\
      \ benefit to the patient.</p>\n<p>The investigator is responsible for the appropriate\
      \ medical care of patients during the study.</p>\n<p>Investigators must document\
      \ their review of each laboratory safety report.</p>\n<p>The investigator remains\
      \ responsible for following, through an appropriate health care option, AEs\
      \ that are serious or otherwise medically important, considered related to the\
      \ investigational product or the study, or that caused the patient to discontinue\
      \ the investigational product before completing the study. The patient should\
      \ be followed until the event resolves, stabilizes with</p>\n<p>appropriate\
      \ diagnostic evaluation, or is reasonably explained. The frequency of follow-up\
      \ evaluations of the AE is left to the discretion of the investigator.</p>\n\
      <p>After the informed consent form is signed, study site personnel will record,\
      \ via CRF, the occurrence and nature of each patient\u2019s preexisting conditions,\
      \ including clinically significant signs and symptoms of the disease under treatment\
      \ in the study. Additionally, site personnel will record any change in the condition(s)\
      \ and the occurrence and nature of any AEs.</p>\n<p>The investigator will interpret\
      \ and document whether or not an AE has a reasonable possibility of being related\
      \ to study treatment, medical device, or a study procedure, taking into account\
      \ the disease, concomitant treatment, or pathologies.</p>\n<p>A \u201Creasonable\
      \ possibility\u201D means that there is a potential cause and effect relationship\
      \ between the investigational product, medical device, and/or study procedure\
      \ and the AE.</p>\n<p>Planned surgeries should not be reported as AEs unless\
      \ the underlying medical condition has worsened during the course of the study.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001430
  - id: NarrativeContent_57
    instanceType: NarrativeContent
    name: SECTION 9.3.1.
    sectionNumber: 9.3.1.
    sectionTitle: Serious Adverse Events
    text: "<div><p>An SAE is any AE from this study that results in one of the following:</p>\n\
      <ul>\n<li>\n<p>death</p>\n</li>\n<li>\n<p>initial or prolonged inpatient hospitalization</p>\n\
      </li>\n<li>\n<p>a life-threatening experience (that is, immediate risk of dying)</p>\n\
      </li>\n<li>\n<p>persistent or significant disability/incapacity</p>\n</li>\n\
      <li>\n<p>congenital anomaly/birth defect</p>\n</li>\n<li>\n<p>important medical\
      \ events that may not be immediately life-threatening or result in death or\
      \ hospitalization but may jeopardize the patient or may require intervention\
      \ to prevent one of the other outcomes listed in the definition above when a\
      \ condition related to the medical device necessitates medical or surgical intervention\
      \ to preclude either permanent impairment of a body function or permanent damage\
      \ to a body structure, the serious outcome of \u201Crequired intervention\u201D\
      \ will be assigned.</p>\n</li>\n</ul>\n<p>Study site personnel must alert the\
      \ Lilly CRP/CP, or its designee, of any SAE as soon as practically possible.</p>\n\
      <p>Additionally, study site personnel must alert Lilly Global Patient Safety,\
      \ or its designee, of any SAE within 24 hours of investigator awareness of the\
      \ event via a sponsor-approved method. If alerts are issued via telephone, they\
      \ are to be immediately followed with official notification on study-specific\
      \ SAE forms. This 24-hour notification requirement refers to the initial SAE\
      \ information and all follow-up SAE information.</p>\n<p>Although all AEs are\
      \ recorded in the CRF after signing informed consent, SAE reporting to the sponsor\
      \ begins after the patient has signed informed consent and has received investigational\
      \ product. However, if an SAE occurs after signing informed consent, but prior\
      \ to receiving investigational product, AND is considered reasonably possibly\
      \ related to a study procedure then it MUST be reported.</p>\n<p>Investigators\
      \ are not obligated to actively seek AEs or SAEs in patients once they have\
      \ discontinued from and/or completed the study (the patient summary CRF has\
      \ been completed). However, if the investigator learns of any SAE, including\
      \ a death, at any time after a patient has been discharged from the study, and\
      \ he/she considers the event reasonably possibly related to the study treatment\
      \ or study participation, the investigator must promptly notify Lilly.</p>\n\
      <p>Pregnancy (maternal or paternal exposure to investigational product) does\
      \ not meet the definition of an AE. However, to fulfill regulatory requirements\
      \ any pregnancy should be reported following the SAE process to collect data\
      \ on the outcome for both mother and fetus.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001431
  - id: NarrativeContent_58
    instanceType: NarrativeContent
    name: SECTION 9.3.1.1.
    sectionNumber: 9.3.1.1.
    sectionTitle: Suspected Unexpected Serious Adverse Reactions
    text: <div><p> Suspected unexpected serious adverse reactions (SUSARs) are serious
      events that are not listed in the IB and that the investigator reports as related
      to investigational product or procedure. Lilly has procedures that will be followed
      for the recording and expedited reporting of SUSARs that are consistent with
      global regulations and the associated detailed guidances.</p></div>
    uuid: 00000000-0000-4000-8000-000000001432
  - id: NarrativeContent_59
    instanceType: NarrativeContent
    name: SECTION 9.3.1.2.
    sectionNumber: 9.3.1.2.
    sectionTitle: Adverse Event Monitoring with a Systematic Questionnaire
    text: '<div><p> Before administering the Nasal and Non-nasal Score Questionnaire
      (see Appendix 6) and Edinburgh Hypoglycemia Scale (see Appendix 7), study site
      personnel will question the patient about any change in the preexisting condition(s)
      and the occurrence and nature of any AEs. Study site personnel will explain
      the possibility to the patient of AEs associated with the study and that these
      AEs will be captured during the study through the use of the Nasal and Non-nasal
      Score Questionnaire and Edinburgh Hypoglycemia Scale.</p>

      <p>Nonserious AEs obtained through the questionnaire are recorded and analyzed
      separately.</p>

      <p>Only SAEs elicited through the Nasal and Non-nasal Score Questionnaire and
      Edinburgh Hypoglycemia Scale are to be recorded as AEs via CRF and reported
      to Lilly or its designee within 24 hours as SAEs.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001433
  - id: NarrativeContent_60
    instanceType: NarrativeContent
    name: SECTION 9.3.2.
    sectionNumber: 9.3.2.
    sectionTitle: Complaint Handling
    text: '<div><p>Lilly collects product complaints on investigational products used
      in clinical trials in order to ensure the safety of study participants, monitor
      quality, and to facilitate process and product improvements.</p>

      <p>Patients should be instructed to contact the investigator as soon as possible
      if he or she has a complaint or problem with the investigational product so
      that the situation can be assessed.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001434
  - id: NarrativeContent_61
    instanceType: NarrativeContent
    name: SECTION 9.4.
    sectionNumber: 9.4.
    sectionTitle: Treatment of Overdose
    text: <div><p>For the purposes of this study, an overdose of LY900018 or IMG is
      considered any dose that is higher than the assigned dose. Refer to the LY900018
      IB and GlucaGen Summary of Product Characteristics for more information.</p></div>
    uuid: 00000000-0000-4000-8000-000000001435
  - id: NarrativeContent_62
    instanceType: NarrativeContent
    name: SECTION 9.5.
    sectionNumber: 9.5.
    sectionTitle: Safety
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001436
  - id: NarrativeContent_63
    instanceType: NarrativeContent
    name: SECTION 9.5.1.
    sectionNumber: 9.5.1.
    sectionTitle: Laboratory Tests
    text: '<div><p>For each patient, laboratory tests detailed in Appendix 2 should
      be conducted according to the Schedule of Activities (Section 2).</p>

      <p>Lilly or its designee will provide the investigator with the results of laboratory
      tests analyzed by a central vendor, if a central vendor is used for the study.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001437
  - id: NarrativeContent_64
    instanceType: NarrativeContent
    name: SECTION 9.5.2.
    sectionNumber: 9.5.2.
    sectionTitle: Vital Signs
    text: '<div><p>For each patient, vital sign measurements should be conducted according
      to the Schedule of Activities (Section 2).</p>

      <p>Body temperature will be measured as specified in the Schedule of Activities
      (Section 2) and as clinically indicated.</p>

      <p>Blood pressure and pulse rate should be measured after at least 5 minutes
      supine.</p>

      <p>Unscheduled orthostatic vital signs should be assessed, if possible, during
      any AE of dizziness or posture-induced symptoms. If orthostatic measurements
      are required, patients should be supine for at least 5 minutes and stand for
      at least 2 minutes. If the patient feels unable to stand, supine vital signs
      only will be recorded. Additional vital signs may be measured during each study
      period if warranted.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001438
  - id: NarrativeContent_65
    instanceType: NarrativeContent
    name: SECTION 9.5.3.
    sectionNumber: 9.5.3.
    sectionTitle: Electrocardiograms
    text: "<div><p>For each patient, single and triplicate ECGs should be collected\
      \ according to the Schedule of Activities (Section 2).</p>\n<p>Any clinically\
      \ significant findings from ECGs that result in a diagnosis and that occur after\
      \ the patient receives the first dose of the investigational product should\
      \ be reported to Lilly, or its designee, as an AE via CRF.</p>\n<p>Single ECGs\
      \ will be collected and stored locally at the investigator\u2019s site.</p>\n\
      <p>Triplicate ECGs will be electronically transmitted to a central ECG laboratory\
      \ designated by Lilly. The central ECG laboratory will perform a basic quality\
      \ control check (for example, demographics and study details) then store the\
      \ ECGs in a database. At a future time, the stored ECG data may be overread\
      \ at the central ECG laboratory for further evaluation of machine-read measurements\
      \ or to meet regulatory requirements. Triplicate ECGs collected 30 and 15 minutes\
      \ prior to the start of insulin-induced hypoglycemia on Day 1 of each period\
      \ will be used to</p>\n<p>establish a baseline. The consecutive triplicate ECGs\
      \ will be obtained at approximately 1-minute intervals.</p>\n<p>When scheduled\
      \ at the same time point, ECGs must be recorded before collecting any blood\
      \ samples. Patients must be supine for at least 5 minutes before ECG collection\
      \ and remain supine but awake during ECG collection. Electrocardiograms may\
      \ be obtained at additional times, when deemed clinically necessary.</p>\n<p>Single\
      \ ECGs will be interpreted by a qualified physician (the investigator or qualified\
      \ designee) at the site as soon after the time of ECG collection as possible,\
      \ and ideally while the patient is still present, to determine whether the patient\
      \ meets entry criteria at the relevant visit(s) and for immediate patient management,\
      \ should any clinically relevant findings be identified.</p>\n<p>If a clinically\
      \ significant finding is identified (including, but not limited to, changes\
      \ in QT/corrected QT interval from baseline) after enrollment, the investigator\
      \ will determine if the patient can continue in the study. The investigator,\
      \ or qualified designee, is responsible for determining if any change in patient\
      \ management is needed, and must document his/her review of the ECG printed\
      \ at the time of collection. Any new clinically relevant finding should be reported\
      \ as an AE.</p>\n<p>The machine-read ECG intervals and heart rate may be used\
      \ for data analysis and report writing purposes unless a cardiologist overread\
      \ of the ECGs is conducted prior to completion of the final study report (in\
      \ which case the overread data would be used).</p></div>"
    uuid: 00000000-0000-4000-8000-000000001439
  - id: NarrativeContent_66
    instanceType: NarrativeContent
    name: SECTION 9.5.4.
    sectionNumber: 9.5.4.
    sectionTitle: Other Tests
    text: <div><p>Nasal inspections with nasal speculum and injection-site assessments
      will be conducted according to the Schedule of Activities (Section 2). This
      inspection will ascertain whether sites are normal in appearance prior to and
      after drug administration.</p></div>
    uuid: 00000000-0000-4000-8000-000000001440
  - id: NarrativeContent_67
    instanceType: NarrativeContent
    name: SECTION 9.5.5.
    sectionNumber: 9.5.5.
    sectionTitle: Safety Monitoring
    text: '<div><p>The Lilly CP or CRP/scientist will monitor safety data throughout
      the course of the study.</p>

      <p>Lilly will review SAEs within time frames mandated by company procedures.
      The Lilly CP or CRP will periodically review the following data:</p>

      <ul>

      <li>

      <p>trends in safety data</p>

      </li>

      <li>

      <p>laboratory analytes</p>

      </li>

      <li>

      <p>AEs including monitoring of nasal cavity and IM injection site When appropriate,
      the Lilly CP or CRP will consult with the functionally independent Global Patient
      Safety therapeutic area physician or clinical research scientist.</p>

      </li>

      </ul></div>'
    uuid: 00000000-0000-4000-8000-000000001441
  - id: NarrativeContent_68
    instanceType: NarrativeContent
    name: SECTION 9.5.5.1.
    sectionNumber: 9.5.5.1.
    sectionTitle: Hypoglycemic Event Reporting
    text: "<div>\"<p> Episodes of hypoglycemia (plasma glucose \u226470 mg/dL) that\
      \ occur after the patient's PG level returns to \u2265100 mg/dL\n  (at least\
      \ after 30 minutes post study dose) at post study treatment on Day 1, will be\
      \ described using the following\n  definitions:</p>\n<b>Documented Glucose Alert\
      \ Level (Level 1)</b>\n<p>Plasma glucose \u226470 mg/dL</p>\n<ul>\n<li>\n<p><i>Documented\
      \ symptomatic hypoglycemia:</i> with typical symptoms of hypoglycemia.</p>\n\
      </li>\n<li>\n<p><i>Documented asymptomatic hypoglycemia:</i> without typical\
      \ symptoms of hypoglycemia.</p>\n</li>\n<li>\n<p><i>Documented unspecified hypoglycemia:</i>\
      \ with no information about symptoms of hypoglycemia available. (This\n    \
      \  has also been called unclassifiable hypoglycemia.)</p>\n</li>\n</ul>\n<b>Documented\
      \ Clinically Significant Hypoglycemia (Level 2)</b>\n<p>Similar criterion as\
      \ for Level 1, except for threshold PG &lt;54 mg/dL</p>\n<ul>\n<li>\n<p><i>Level\
      \ 2 documented symptomatic hypoglycemia</i></p>\n</li>\n<li>\n<p>Level 2 documented\
      \ asymptomatic hypoglycemia</p>\n</li>\n<li>\n<p><i>Level 2 documented unspecified\
      \ hypoglycemia</i></p>\n</li>\n</ul>\n<b>Severe Hypoglycemia (Level 3)</b>\n\
      <p>Patient had altered mental status and could not assist in their own care,\
      \ was semiconscious or unconscious, or\n  experienced coma with or without seizures,\
      \ and the assistance of another person was to actively administer\n  carbohydrate,\
      \ glucagon, or other resuscitative actions. Plasma glucose\n  measurements may\
      \ not be available during such an event, but neurological recovery attributable\
      \ to the restoration of\n  PG concentration to normal is considered sufficient\
      \ evidence that the event was induced by a low PG concentration (PG\n  \u2264\
      70 mg/dL).</p>\n<p><b>Other Hypoglycemia</b></p>\n<ul>\n<li>\n<p><i>Nocturnal\
      \ hypoglycemia:</i>Any documented hypoglycemic event (including severe hypoglycemia)\
      \ that occurs at\n      night and presumably during sleep. This is captured\
      \ as hypoglycemia that occurs between bedtime and waking. This definition\n\
      \      is more useful than the commonly used approximately 00:00 to 06:00 definition\
      \ which does not take patients'\n      individual sleep times into consideration,\
      \ and is consistent with the American Diabetes Association recommendations of\n\
      \      reporting events that occur during sleep (ADA 2005). It is also important\
      \ to collect the actual time when a hypoglycemic\n      event occurred to allow\
      \ further characterization of hypoglycemia timing (eg, to allow analysis of\
      \ frequency of events\n      occurring across a 24-hour clock). Nocturnal hypoglycemia\
      \ may occur at severity Levels 1, 2, or 3.</p>\n</li>\n<li>\n<p><i>Relative\
      \ hypoglycemia (also referred to as pseudohypoglycemia [Seaquist et al. 2013]):</i>\
      \ An event during which\n      typical symptoms of hypoglycemia occur, that\
      \ does not require the assistance of another person and is accompanied by PG\n\
      \      &gt;70 mg/dL. The PG value of patients with chronically poor glycemic\
      \ control can decrease so rapidly that patients may\n      report symptoms of\
      \ hypoglycemia before their PG concentration falls below 70 mg/dL. Events with\
      \ PG \u226470 mg/dL\n      should not be categorized as relative hypoglycemia.\
      \ Evaluation and statistical analysis of this category is optional.\n      However,\
      \ if a patient reports a relative hypoglycemia event where assistance from another\
      \ person was received or\n      the patient experienced significant symptoms,\
      \ the study team\n      should clarify the circumstances to ensure the event\
      \ is not a severe hypoglycemia event, and report it\n      appropriately.</p>\n\
      </li>\n<li>\n<p><i>Probable symptomatic hypoglycemia:</i> Symptoms of hypoglycemia\
      \ were present, but PG measurement was not reported.</p>\n</li>\n<li>\n<p><i>Overall\
      \ (or total) hypoglycemia:</i> This optional category combines most cases of\
      \ hypoglycemia (documented\n      hypoglycemia\n      and probable symptomatic\
      \ hypoglycemia, including severe hypoglycemia). It does not include relative\
      \ hypoglycemia.\n      Nocturnal and severe hypoglycemia are special cases of\
      \ documented or probable hypoglycemia. If an event of\n      hypoglycemia falls\
      \ into multiple subcategories, that event should only be counted once in the\
      \ category of overall\n      (or total) hypoglycemia.</p>\n</li>\n</ul>\n<p>Hypoglycemia\
      \ episodes will be recorded on specific CRF pages. Only severe hypoglycemic\
      \ episodes will be reported\n  separately as AEs. If a hypoglycemic event meets\
      \ the criteria of severe, it needs to be recorded as serious in the CRF\n  (that\
      \ is, recorded as an SAE). In the case of a hypoglycemic event (other than severe),\
      \ the actual glucose value, if\n  measured, should be recorded in the CRF, with\
      \ any treatments administered, and not be recorded as an AE. Cases of\n  hypoglycemia\
      \ may be treated with foods rich in carbohydrate such as fruit, juice, skimmed\
      \ milk, or energy bars. All\n  episodes of hypoglycemia that are determined\
      \ by the investigator to constitute severe hypoglycemia according to the\n \
      \ definition above should be reported as SAEs.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001442
  - id: NarrativeContent_69
    instanceType: NarrativeContent
    name: SECTION 9.5.5.2.
    sectionNumber: 9.5.5.2.
    sectionTitle: Hepatic Safety
    text: "<div><p> If a study patient experiences elevated alanine aminotransferase\
      \ (ALT) \u22653x upper limit of normal (ULN), alkaline\n  phosphatase (ALP)\
      \ \u22652\xD7 ULN, or elevated total bilirubin (TBL) \u22652x ULN, liver tests\
      \ (Appendix 4) should be repeated\n  within 3 to 5 days including ALT, aspartate\
      \ aminotransferase, ALP, TBL, direct bilirubin, gamma-glutamyl transferase,\n\
      \  and creatinine kinase to confirm the abnormality and to determine if it is\
      \ increasing or decreasing. If the\n  abnormality persists or worsens, clinical\
      \ and laboratory monitoring should be initiated by the investigator based on\n\
      \  consultation with the Lilly CP or CRP. Monitoring should continue until levels\
      \ normalize and/or are returning to\n  approximate baseline levels.</p>\n<p>Additional\
      \ safety data should be collected if 1 or more of the following conditions occur:</p>\n\
      <ul>\n<li>\n<p>elevation of serum ALT to \u22655x ULN on 2 or more consecutive\
      \ blood tests</p>\n</li>\n<li>\n<p>elevated serum TBL to \u22652x ULN (except\
      \ for cases of known Gilbert's syndrome)</p>\n</li>\n<li>\n<p>elevation of serum\
      \ ALP to \u22652x ULN on 2 or more consecutive blood tests</p>\n</li>\n<li>\n\
      <p>patient discontinued from treatment due to a hepatic event or abnormality\
      \ of liver tests</p>\n</li>\n<li>\n<p>hepatic event considered to be an SAE.</p>\n\
      </li>\n</ul></div>"
    uuid: 00000000-0000-4000-8000-000000001443
  - id: NarrativeContent_70
    instanceType: NarrativeContent
    name: SECTION 9.6.
    sectionNumber: 9.6.
    sectionTitle: Pharmacokinetics
    text: <div><p>At the visits and times specified in the Schedule of Activities
      (see Section 2), venous blood samples of approximately 4 mL each will be collected
      to determine the plasma concentrations of glucagon. Three samples may be collected
      per patient at additional time points during the study if warranted and agreed
      upon between both the investigator and sponsor. Instructions for the collection
      and handling of blood samples will be provided by the sponsor. The actual date
      and time (24-hour clock) of each sampling will be recorded.</p></div>
    uuid: 00000000-0000-4000-8000-000000001444
  - id: NarrativeContent_71
    instanceType: NarrativeContent
    name: SECTION 9.6.1.
    sectionNumber: 9.6.1.
    sectionTitle: Bioanalysis
    text: '<div><p>Samples will be analyzed at a laboratory approved by the sponsor
      and stored at a facility designated by the sponsor.</p>

      <p>Concentrations of glucagon will be assayed using a validated liquid chromatography
      with tandem mass spectrometry method.</p>

      <p>Bioanalytical samples collected to measure investigational product concentrations
      will be retained for a maximum of 1 year following last patient visit for the
      study.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001445
  - id: NarrativeContent_72
    instanceType: NarrativeContent
    name: SECTION 9.7.
    sectionNumber: 9.7.
    sectionTitle: Pharmacodynamics
    text: '<div><p>At times specified in the Schedule of Activities (see Section 2),
      venous blood samples will be collected and used to determine PG concentrations.</p>

      <p>The samples will be stored for up to a maximum of 1 year after last patient
      visit for the study at a facility selected by the sponsor.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001446
  - id: NarrativeContent_73
    instanceType: NarrativeContent
    name: SECTION 9.7.1.
    sectionNumber: 9.7.1.
    sectionTitle: Immunogenicity Assessments
    text: '<div><p>At the visits and times specified in the Schedule of Activities
      (Section 2), venous blood samples will be collected to determine antibody production
      against glucagon. To interpret the results of immunogenicity, a venous blood
      sample may be collected at the same time points to determine the concentrations
      of glucagon. All samples for immunogenicity should be taken predose when applicable.</p>

      <p>In the event of drug hypersensitivity reactions (immediate or non-immediate),
      additional immunogenicity samples will be collected as close to the onset of
      the event as possible, at the resolution of the event, and 30 days following
      the event. A PK sample may be collected at these same time points(s) if warranted
      and agreed upon between both the investigator and sponsor.</p>

      <p>Treatment-emergent antidrug antibodies (TE ADA) are defined in Section 10.3.6.
      If the immunogenicity titer at the last scheduled assessment or discontinuation
      visit meets the definition of treatment emergent, then, at the discretion of
      the sponsor, patients should be called back to the site for follow-up immunogenicity
      assessment(s). Samples for immunogenicity should be collected every 12 weeks
      until the titer returns to baseline (ie, returns to within a single 2-fold dilution
      of the baseline titer) or until 1 year after the last dose of study treatment.
      A PK sample may be collected at the follow-up immunogenicity assessment(s) if
      warranted and agreed upon between both the investigator and sponsor. Every attempt
      should be made to contact patients for the follow-up immunogenicity assessment;
      however, if patients are unwilling or unable to return for the visit, this is
      not considered a protocol violation.</p>

      <p>Instructions for the collection and handling of blood samples will be provided
      by the sponsor. The actual date and time (24-hour clock time) of each sampling
      will be recorded.</p>

      <p>Immunogenicity will be assessed by a validated assay designed to detect antidrug
      antibodies (ADA) in the presence of glucagon at a laboratory approved by the
      sponsor. Antibodies may be further characterized and/or evaluated for their
      ability to neutralize the activity of glucagon.</p>

      <p>Samples will be retained for a maximum of 15 years after the last patient
      visit, or for a shorter period if local regulations and ethical review boards
      (ERBs) allow, at a facility selected by the sponsor. The duration allows the
      sponsor to respond to future regulatory requests related to LY900018. Any samples
      remaining after 15 years will be destroyed.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001447
  - id: NarrativeContent_74
    instanceType: NarrativeContent
    name: SECTION 9.8.
    sectionNumber: 9.8.
    sectionTitle: Genetics
    text: '<div><p>A blood sample will be collected for pharmacogenetic analysis as
      specified in the Schedule of Activities (Section 2), where local regulations
      allow.</p>

      <p>Samples will not be used to conduct unspecified disease or population genetic
      research either now or in the future. Samples will be used to investigate variable
      exposure or response to nasal glucagon (LY900018) and to investigate genetic
      variants thought to play a role in diabetes mellitus and related complications.
      Assessment of variable response may include evaluation of AEs or differences
      in efficacy.</p>

      <p>All samples will be coded with the patient number. These samples and any
      data generated can be linked back to the patient only by the investigative site
      personnel.</p>

      <p>Samples will be retained for a maximum of 15 years after the last patient
      visit, or for a shorter period if local regulations and/or ERBs impose shorter
      time limits, for the study at a facility selected by Lilly or its designee.
      This retention period enables use of new technologies, response to regulatory
      questions, and investigation of variable response that may not be observed until
      later in the development of LY900018 or after LY900018 is commercially available.</p>

      <p>Molecular technologies are expected to improve during the 15-year storage
      period and therefore cannot be specifically named. However, existing approaches
      include whole genome or exome sequencing, genome wide association studies, multiplex
      assays, and candidate gene studies. Regardless of technology utilized, data
      generated will be used only for the specific research scope described in this
      section.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001448
  - id: NarrativeContent_75
    instanceType: NarrativeContent
    name: SECTION 9.9.
    sectionNumber: 9.9.
    sectionTitle: Biomarkers
    text: <div><p>Not applicable.</p></div>
    uuid: 00000000-0000-4000-8000-000000001449
  - id: NarrativeContent_76
    instanceType: NarrativeContent
    name: SECTION 9.10.
    sectionNumber: 9.10.
    sectionTitle: Health Economics
    text: <div><p>Not applicable.</p></div>
    uuid: 00000000-0000-4000-8000-000000001450
  - id: NarrativeContent_77
    instanceType: NarrativeContent
    name: SECTION 10
    sectionNumber: '10'
    sectionTitle: Statistical Considerations and Data Analysis
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001451
  - id: NarrativeContent_78
    instanceType: NarrativeContent
    name: SECTION 10.1.
    sectionNumber: 10.1.
    sectionTitle: Sample Size Determination
    text: '<div><p>Seventy five patients may be enrolled in order to have at least
      66 patients (at least 30 patients with T1DM and T2DM, respectively) complete
      the study. For purposes of this study, a completer is defined as a patient who
      completes both periods with evaluable primary outcome. If patients discontinue
      from the study before completion of both periods with evaluable primary outcome
      for any reason, the patient may be replaced to ensure 66 patients complete the
      study. The replacement patients will be assigned the same treatment sequence
      as the patients to be replaced and will complete that treatment sequence in
      its entirety. Replacement should not occur beyond 75 patients enrolled, if it
      is expected to have at least 66 patients complete the study.</p>

      <p>Assuming a non-inferiority margin (NIM) of 10%, a 98% treatment success rate
      for both treatment groups, and a within-patient correlation of zero, 66 completers
      will provide at least 90% power to show non-inferiority between LY900018 and
      IMG in treatment success from insulin-induced hypoglycemia with one-sided alpha
      level of 0.025 based on the Chi-square test.</p>

      <p>The proposed NIM of 10% has been chosen based on the previously completed
      Phase 3 study (Rickels et al. 2016).</p></div>'
    uuid: 00000000-0000-4000-8000-000000001452
  - id: NarrativeContent_79
    instanceType: NarrativeContent
    name: SECTION 10.2.
    sectionNumber: 10.2.
    sectionTitle: Populations for Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001453
  - id: NarrativeContent_80
    instanceType: NarrativeContent
    name: SECTION 10.2.1.
    sectionNumber: 10.2.1.
    sectionTitle: Study Participant Disposition
    text: '<div><p>A detailed description of patient disposition will be provided
      at the end of the study.</p>

      <p>Proportion of patients discontinued from the study and the reasons for discontinuation
      will be summarized by treatment group for all randomized patients.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001454
  - id: NarrativeContent_81
    instanceType: NarrativeContent
    name: SECTION 10.2.2.
    sectionNumber: 10.2.2.
    sectionTitle: Study Participant Characteristics
    text: "<div><p>The patients\u2019 baseline characteristics and demographic characteristics\
      \ will be recorded, listed, and will be summarized for all randomized patients.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001455
  - id: NarrativeContent_82
    instanceType: NarrativeContent
    name: SECTION 10.2.3.
    sectionNumber: 10.2.3.
    sectionTitle: Treatment Compliance
    text: <div><p>No specific study data will be collected for analysis of treatment
      compliance.</p></div>
    uuid: 00000000-0000-4000-8000-000000001456
  - id: NarrativeContent_83
    instanceType: NarrativeContent
    name: SECTION 10.3.
    sectionNumber: 10.3.
    sectionTitle: Statistical Analyses
    text: '<div><p>Statistical analysis of this study will be the responsibility of
      Eli Lilly and Company or its designee.</p>

      <p>Efficacy, PK, and PD analyses will be conducted on the full analysis set.
      This set includes all data from all randomized patients receiving at least one
      dose of the investigational product according to the treatment allocation. Safety
      analyses will be conducted for all enrolled patients, whether or not they completed
      all protocol requirements. If a patient receives a glucose infusion to prevent
      the progression to severe hypoglycemia (see Section 9.2.4), data after IV glucose</p>

      <p>infusion may be excluded from the efficacy and PD analyses. Details will
      be described in the statistical analysis plan (SAP).</p>

      <p>Any change to the data analysis methods described in the protocol will require
      an amendment ONLY if it changes a principal feature of the protocol. Any other
      change to the data analysis methods described in the protocol, and the justification
      for making the change, will be described in the SAP and/or in the clinical study
      report.</p>

      <p>Additional exploratory analyses of the data will be conducted as deemed appropriate.
      Study results may be pooled with the results of other studies for population
      PK analysis purposes to avoid issues with post-hoc analyses and incomplete disclosures
      of analyses.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001457
  - id: NarrativeContent_84
    instanceType: NarrativeContent
    name: SECTION 10.3.1.
    sectionNumber: 10.3.1.
    sectionTitle: Efficacy Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001458
  - id: NarrativeContent_85
    instanceType: NarrativeContent
    name: SECTION 10.3.1.1.
    sectionNumber: 10.3.1.1.
    sectionTitle: Primary Efficacy Analysis
    text: "<div><p> The primary objective is to demonstrate that 3 mg LY900018 is\
      \ non-inferior to 1 mg IMG for the proportion (NIM=10%)\n  of Japanese patients\
      \ with T1DM or T2DM who achieve treatment success without receiving additional\
      \ actions to increase\n  the PG concentration. Treatment success is defined\
      \ as either an increase in PG to \u226570 mg/dL or an increase of \u226520\n\
      \  mg/dL from PG nadir within 30 minutes after receiving study treatment. The\
      \ nadir is defined as the minimum PG\n  concentration at the time of or within\
      \ 10 minutes following glucagon administration.</p>\n<p>The primary analysis\
      \ will be a treatment group comparison of the primary outcome. The percentage\
      \ of treatment\n  successes in each treatment group and the difference in percentages\
      \ will be computed. A 2-sided 95% confidence\n  interval (CI) will be obtained\
      \ from the 1-sample mean of the paired differences in primary outcome (1=outcome\n\
      \  observed; 0=outcome not observed) across 2 treatment visits. Non-inferiority\
      \ of LY900018 will be declared if the upper\n  limit of a 2-sided 95% CI constructed\
      \ on the difference in percentages (IMG - LY900018) is less than the NIM of\
      \ 10%.\n</p>\n<p>Primary efficacy analysis will only include patients who complete\
      \ both treatment visits with evaluable primary\n  outcome. The following will\
      \ be considered as non-evaluable primary efficacy outcomes and will be excluded\
      \ from the\n  analysis related to primary efficacy outcome:</p>\n<ul>\n<li>\n\
      <p>Patients with at least 1 treatment visit in which the lowest PG concentration\
      \ at the time of or within 10 minutes\n      following glucagon administration\
      \ is \u226570 mg/dL;</p>\n</li>\n<li>\n<p>Patients who receive an external measure\
      \ to raise PG concentration either before glucagon administration or\n     \
      \ within the first 10 minutes of glucagon administration.</p>\n</li>\n</ul>\n\
      <p>Plasma glucose concentrations assessed through a central laboratory will\
      \ be used to assess treatment success.\n  Additional analysis will be performed\
      \ if deemed necessary. The details will be provided in the SAP.</p>\n<p>Descriptive\
      \ statistics will be used to summarize the baseline, various postdose time points,\
      \ and absolute change from\n  baseline in PG values by treatment group. Additional\
      \ analysis will be performed if deemed necessary. The details will\n  be provided\
      \ in the SAP.</p>\n<p>If a patient receives additional intervention to raise\
      \ PG concentrations, measurements taken after the time of\n  intervention will\
      \ be excluded from the analysis.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001459
  - id: NarrativeContent_86
    instanceType: NarrativeContent
    name: SECTION 10.3.1.2.
    sectionNumber: 10.3.1.2.
    sectionTitle: Secondary Efficacy Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001460
  - id: NarrativeContent_87
    instanceType: NarrativeContent
    name: SECTION 10.3.1.2.1
    sectionNumber: 10.3.1.2.1
    sectionTitle: Plasma Glucose Values
    text: "<div><p>Descriptive statistics will be used to summarize the baseline,\
      \ various postdose time points, and absolute change from\n  baseline in total\
      \ score and each subscale score of Edinburgh Hypoglycemia Scale by treatment\
      \ group. Additional\n  analysis will be performed if deemed necessary. The details\
      \ will be provided in the SAP.</p>\n<p>If a patient receives additional intervention\
      \ to raise PG concentrations, measurements taken after the time of \n  intervention\
      \ will be excluded from the analysis.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001461
  - id: NarrativeContent_88
    instanceType: NarrativeContent
    name: SECTION 10.3.1.3.
    sectionNumber: 10.3.1.3.
    sectionTitle: Exploratory Efficacy Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001462
  - id: NarrativeContent_89
    instanceType: NarrativeContent
    name: SECTION 10.3.1.3.1
    sectionNumber: 10.3.1.3.1
    sectionTitle: Symptoms of Hypoglycemia
    text: "<div><p>Descriptive statistics will be used to summarize the baseline,\
      \ various postdose time points, and absolute change from\n  baseline in total\
      \ score and each subscale score of Edinburgh Hypoglycemia Scale by treatment\
      \ group. Additional\n  analysis will be performed if deemed necessary. The details\
      \ will be provided in the SAP.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001463
  - id: NarrativeContent_90
    instanceType: NarrativeContent
    name: SECTION 10.3.2.
    sectionNumber: 10.3.2.
    sectionTitle: Safety Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001464
  - id: NarrativeContent_91
    instanceType: NarrativeContent
    name: SECTION 10.3.2.1.
    sectionNumber: 10.3.2.1.
    sectionTitle: Clinical Evaluation of Safety
    text: '<div><p>

      All investigational product and protocol procedure AEs will be listed, and,
      if the frequency of

      events allows, safety data will be summarized using descriptive methodology.</p>

      <p>The incidence of symptoms for each treatment will be presented by severity
      and by association with investigational product as perceived by the investigator.
      Symptoms reported to occur prior to enrollment will be distinguished from those
      reported as new or increased in severity during the study.</p>

      <p>The number of investigational product-related SAEs will be reported.</p>

      <p>Nasal/respiratory and anosmia AEs will be identified using preferred terms
      and summarized by treatment group; the details will be provided in the SAP.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001465
  - id: NarrativeContent_92
    instanceType: NarrativeContent
    name: SECTION 10.3.2.2.
    sectionNumber: 10.3.2.2.
    sectionTitle: Nasal and Non-nasal Score Questionnaire
    text: "<div><p> The scoring for each response to Nasal and Non-nasal Score Questionnaire\
      \ will follow the scale displayed on the questionnaire (\u2018None\u2019=0,\
      \ \u2018Mild\u2019=1, \u2018Moderate\u2019=2, \u2018Severe\u2019=3). The total\
      \ score of the questionnaire will be calculated as the sum of the scores for\
      \ each question. Descriptive statistics will be used to summarize the baseline,\
      \ various postdose time points, and absolute change from baseline in total score\
      \ of Nasal and Non-nasal Score Questionnaire by treatment group. See Appendix\
      \ 6 for a copy of the questionnaire. Additional analysis will be performed if\
      \ deemed necessary. The details will be provided in the SAP.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001466
  - id: NarrativeContent_93
    instanceType: NarrativeContent
    name: SECTION 10.3.2.3.
    sectionNumber: 10.3.2.3.
    sectionTitle: Statistical Evaluation of Safety
    text: <div><p> Safety parameters that will be assessed include safety laboratory
      parameters, vital signs, and triplicated ECG parameters. The parameters will
      be listed and summarized using standard descriptive statistics. Additional analysis
      will be performed if warranted upon review of the data. The details will be
      provided in the SAP.</p></div>
    uuid: 00000000-0000-4000-8000-000000001467
  - id: NarrativeContent_94
    instanceType: NarrativeContent
    name: SECTION 10.3.3.
    sectionNumber: 10.3.3.
    sectionTitle: Pharmacokinetic Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001468
  - id: NarrativeContent_95
    instanceType: NarrativeContent
    name: SECTION 10.3.3.1.
    sectionNumber: 10.3.3.1.
    sectionTitle: Pharmacokinetic Parameter Estimation
    text: '<div><p> Patients who receive at least 1 dose of study treatment and have
      measurable glucagon concentrations will be included in the PK analysis dataset.
      Pharmacokinetic parameter estimates for glucagon will be calculated using standard
      noncompartmental methods of analysis (NCA).</p>

      <p>The primary parameters for PK analysis will be maximal concentration (C max
      ), area under the concentration versus time curve (AUC), and time to maximal
      concentration (T max ) of glucagon. Other noncompartmental parameters, such
      as half-life, apparent clearance, and apparent volume of distribution, may be
      reported.</p>

      <p>The following PK parameters will also be calculated using baseline-adjusted
      (ie, change from baseline) concentrations of glucagon: AUC, C max , and T max
      . Baseline glucagon concentrations will be concentrations from samples obtained
      immediately prior to glucagon dosing (ie, predose).</p>

      <p>Parameters will be individually calculated for each patient based on actual
      time of collection.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001469
  - id: NarrativeContent_96
    instanceType: NarrativeContent
    name: SECTION 10.3.3.2.
    sectionNumber: 10.3.3.2.
    sectionTitle: Pharmacokinetic Statistical Inference
    text: '<div><p> Log-transformed PK parameters (such as C max and AUC) will be
      evaluated in a linear mixed-effects model with fixed effects for treatment,
      period, and sequence, and a random effect for patient. The treatment differences
      will be back-transformed to present the ratios of geometric means and the corresponding
      90% CIs.</p>

      <p>The T max will be analyzed using the Wilcoxon signed-rank test. Estimates
      of the median difference based on the observed medians, 90% CIs, and p-values
      from the Wilcoxon test will be calculated.</p>

      <p>Exploratory analyses may be performed for other PK parameters as deemed appropriate.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001470
  - id: NarrativeContent_97
    instanceType: NarrativeContent
    name: SECTION 10.3.4.
    sectionNumber: 10.3.4.
    sectionTitle: Pharmacodynamic Analyses
    text: <div></div>
    uuid: 00000000-0000-4000-8000-000000001471
  - id: NarrativeContent_98
    instanceType: NarrativeContent
    name: SECTION 10.3.4.1.
    sectionNumber: 10.3.4.1.
    sectionTitle: Pharmacodynamic Parameter Estimation
    text: "<div><p> Pharmacodynamic parameters will be calculated using NCA. Key PD\
      \ parameters will be derived to assess the exposure to\n  glucose and duration\
      \ of exposure above, below, and within the normal glucose range. The normal\
      \ range for PG will be\n  considered to be 70 to 108 mg/dL. Actual sampling\
      \ times will be used for all calculations.</p>\n<p>The following PD parameters\
      \ will be calculated using concentrations of glucose:</p>\n<table class=\"table\"\
      >\n<tr>\n<td></td>\n</tr>\n<tr>\n<td>\n<p>AUEC above</p>\n</td>\n<td>\n<p>area\
      \ under the effect concentration-time curve above the normal range</p>\n</td>\n\
      </tr>\n<tr>\n<td>\n<p>AUEC below</p>\n</td>\n<td>\n<p>area under the effect\
      \ concentration-time curve below the normal range</p>\n</td>\n</tr>\n<tr>\n\
      <td>\n<p>AUEC within</p>\n</td>\n<td>\n<p>area under the effect concentration-time\
      \ curve within the normal range</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>AUEC 0-1.5</p>\n\
      </td>\n<td>\n<p>area under the effect concentration-time curve from time zero\
      \ (predose) up to 1.5 hours</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>BG max</p>\n</td>\n\
      <td>\n<p>maximal plasma glucose concentration</p>\n</td>\n</tr>\n<tr>\n<td>\n\
      <p>Duration above</p>\n</td>\n<td>\n<p>duration above normal range</p>\n</td>\n\
      </tr>\n<tr>\n<td>\n<p>Duration below</p>\n</td>\n<td>\n<p>duration below normal\
      \ range</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>Duration within</p>\n</td>\n<td>\n\
      <p>duration within normal range</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>t above</p>\n\
      </td>\n<td>\n<p>time to concentrations above normal range</p>\n</td>\n</tr>\n\
      <tr>\n<td>\n<p>t below</p>\n</td>\n<td>\n<p>time to concentrations below normal\
      \ range (after t above )</p>\n</td>\n</tr>\n<tr>\n<td>\n<p>t within</p>\n</td>\n\
      <td>\n<p>time to concentrations within normal range</p>\n</td>\n</tr>\n<tr>\n\
      <td>\n<p>T max</p>\n</td>\n<td>\n<p>time to maximal concentration</p>\n</td>\n\
      </tr>\n</table>\n<p>The following PD parameters will be calculated using change\
      \ from baseline concentrations of PG:</p>\n<table class=\"table\">\n<tr>\n<td>\n\
      <p>AUEC 0-1.5 </p>\n</td>\n<td>\n<p>area under the effect concentration-time\
      \ curve from time zero (predose) up to 1. 5 hours</p>\n</td>\n</tr>\n<tr>\n\
      <td>\n<p>BG max </p>\n</td>\n<td>\n<p>maximal plasma glucose concentration</p>\n\
      </td>\n</tr>\n<tr>\n<td>\n<p>T max </p>\n</td>\n<td>\n<p>time to maximal concentration</p>\n\
      </td>\n</tr>\n</table>\n<p>Baseline PG concentrations will be concentrations\
      \ from samples obtained immediately prior to glucagon dosing (ie,\n  zero hour\
      \ time point).</p>\n<p>Other PD parameters of PG may be calculated if required.\
      \ Individual concentrations and PD parameters of PG will be\n  summarized with\
      \ descriptive statistics by treatment. The patients who receive IV glucose up\
      \ to 90 minutes postdose\n  will be excluded from the summary statistics.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001472
  - id: NarrativeContent_99
    instanceType: NarrativeContent
    name: SECTION 10.3.4.2.
    sectionNumber: 10.3.4.2.
    sectionTitle: Pharmacodynamic Statistical Inference
    text: '<div><p>The PD parameters (such as BGmax and AUEC) will be log-transformed
      prior to analysis and a

      linear mixed-effects model fitted to the data, with treatment, period, and sequence
      as fixed

      effects and patient as a random effect. For each parameter, the treatment difference
      will be

      back-transformed to present the ratios of geometric means and the corresponding
      90% CIs.</p>

      <p>The values of Tmax will be analyzed nonparametrically using the Wilcoxon
      signed-rank test.

      Median differences and approximate 90% CIs for the difference will be calculated
      for the

      comparisons of treatments.</p>

      <p>Exploratory analyses may be performed for other PD parameters as deemed appropriate.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001473
  - id: NarrativeContent_100
    instanceType: NarrativeContent
    name: SECTION 10.3.5.
    sectionNumber: 10.3.5.
    sectionTitle: Pharmacokinetic/Pharmacodynamic Analyses
    text: <div><p>Exploratory analyses may be performed to evaluate exposure-response
      relationship if needed.</p></div>
    uuid: 00000000-0000-4000-8000-000000001474
  - id: NarrativeContent_101
    instanceType: NarrativeContent
    name: SECTION 10.3.6.
    sectionNumber: 10.3.6.
    sectionTitle: Evaluation of Immunogenicity
    text: '<div><p>The frequency and percentage of patients with preexisting (baseline)
      ADA, ADA at any time point after baseline, and patients with TE ADA to glucagon
      may be tabulated.</p>

      <p>Treatment-emergent ADA are defined as those with a titer 2-fold (1 dilution)
      greater than the minimum required dilution of the assay, if no ADA were detected
      at baseline; or those with a 4-fold (2 dilutions) increase in titer compared
      to baseline, if ADA were detected at baseline. For patients with TE ADA, the
      distribution of maximum titers may be described. The frequency of neutralizing
      antibodies may also be tabulated.</p>

      <p>The relationship between the presence of antibodies to glucagon and efficacy,
      PK parameters, PD response, and safety results may be assessed.</p></div>'
    uuid: 00000000-0000-4000-8000-000000001475
  - id: NarrativeContent_102
    instanceType: NarrativeContent
    name: SECTION 10.3.7.
    sectionNumber: 10.3.7.
    sectionTitle: Data Review During the Study
    text: "<div><p>Access to safety data is scheduled to occur after the first 6 patients\
      \ complete Period 2 Day 1. The purpose of this review is to initiate remaining\
      \ patients\u2019 dosing. The investigator and the Lilly sponsor team will make\
      \ the determination regarding initiation of remaining patients\u2019 dose, based\
      \ upon their review of the data.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001476
  - id: NarrativeContent_103
    instanceType: NarrativeContent
    name: SECTION 10.3.8.
    sectionNumber: 10.3.8.
    sectionTitle: Interim Analyses
    text: "<div><p>Access to the safety data, including AEs, SAEs, vital signs, ECGs,\
      \ and safety laboratory tests, is scheduled to occur after the first 6 patients\
      \ complete Period 2. The purpose of the safety reviews is to ensure that the\
      \ study procedures and treatment are safe enough to proceed with the remaining\
      \ patients. The investigator and the Lilly sponsor team will make the determination\
      \ to proceed with randomization of the remaining patients based upon their review\
      \ of the safety and tolerability data.</p>\n<p>A primary database lock will\
      \ be conducted after last patient discharge from the CRU. The aim of the primary\
      \ database lock is to enable data analysis to assess the primary/secondary objectives,\
      \ and may include assessment of exploratory objectives. The primary database\
      \ lock will include all study data, except for immunogenicity data, up to the\
      \ last patient discharge from the CRU.</p>\n<p>If patients need additional follow-up\
      \ for TE ADA, an additional database lock may be conducted to develop the clinical\
      \ study report. The database lock may contain all patients\u2019 data up to\
      \ the follow-up visit, except for immunogenicity data. The final database lock\
      \ is planned after all patients complete the follow-up period and additional\
      \ follow-up for TE ADA (if needed).</p></div>"
    uuid: 00000000-0000-4000-8000-000000001477
