  - id: NarrativeContent_105
    instanceType: NarrativeContent
    name: SECTION Appendix 1.
    sectionNumber: Appendix 1.
    sectionTitle: Abbreviations and Definitions
    text: "<div><table class=\"table\">\n<tr>\n<th>Term</th>\n<th>Definition</th>\n\
      </tr>\n<tr>\n<th>ADA</th>\n<td>antidrug antibodies adverse event: Any untoward\
      \ medical occurrence in a patient or clinical investigation\n      patient\n\
      \      administered a pharmaceutical product that does not necessarily have\
      \ a causal relationship with this treatment. An\n      AE can therefore be any\
      \ unfavorable and unintended sign (including an abnormal laboratory finding),\
      \ symptom, or\n      disease temporally associated with the use of a medicinal\
      \ (investigational) product, whether or not related to the\n      medicinal\
      \ (investigational) product.</td>\n</tr>\n<tr>\n<th>ALP</th>\n<td>alkaline phosphatase</td>\n\
      </tr>\n<tr>\n<th>ALT</th>\n<td>alanine aminotransferase</td>\n</tr>\n<tr>\n\
      <th>AUC</th>\n<td>area under the concentration versus time curve</td>\n</tr>\n\
      <tr>\n<th>AUEC<sub>above</sub></th>\n<td>area under the effect concentration-time\
      \ curve above the normal range</td>\n</tr>\n<tr>\n<th>AUEC<sub>below</sub></th>\n\
      <td>area under the effect concentration-time curve below the normal range</td>\n\
      </tr>\n<tr>\n<th>AUEC<sub>within</sub></th>\n<td>area under the effect concentration-time\
      \ curve within the normal range</td>\n</tr>\n<tr>\n<th>AUEC<sub>0-1.5</sub></th>\n\
      <td>area under the effect concentration-time curve from time zero (predose)\
      \ up to 1.5 hours</td>\n</tr>\n<tr>\n<th>BGmax</th>\n<td>maximal plasma glucose\
      \ concentration</td>\n</tr>\n<tr>\n<th>BP</th>\n<td>blood pressure</td>\n</tr>\n\
      <tr>\n<th>CI</th>\n<td>confidence interval</td>\n</tr>\n<tr>\n<th>CIOMS</th>\n\
      <td>Council for International Organizations of Medical Sciences</td>\n</tr>\n\
      <tr>\n<th>C<sub>max</sub></th>\n<td>maximal concentration</td>\n</tr>\n<tr>\n\
      <th>complaint</th>\n<td>A complaint is any written, electronic, or oral communication\
      \ that alleges deficiencies related to the identity,\n      quality, purity,\
      \ durability, reliability, safety or effectiveness, or performance of a drug\
      \ or drug delivery\n      system.</td>\n</tr>\n<tr>\n<th>compliance</th>\n<td>Adherence\
      \ to all the study-related requirements, good clinical practice (GCP) requirements,\
      \ and the applicable\n      regulatory requirements.</td>\n</tr>\n<tr>\n<th>confirmation</th>\n\
      <td>A process used to confirm that laboratory test results meet the quality\
      \ requirements defined by the laboratory\n      generating the data and that\
      \ Lilly is confident that results are accurate. Confirmation will either occur\n\
      \      immediately after initial testing or will require that samples be held\
      \ to be retested at some defined time point,\n      depending on the steps required\
      \ to obtain confirmed results.</td>\n</tr>\n<tr>\n<th>CP</th>\n<td>clinical\
      \ pharmacologist</td>\n</tr>\n<tr>\n<th>CRF</th>\n<td>case report form</td>\n\
      </tr>\n<tr>\n<th>CRP</th>\n<td>clinical research physician: Individual responsible\
      \ for the medical conduct of the study.\n      Responsibilities of the CRP may\
      \ be performed by a physician, clinical research scientist, global safety physician\n\
      \      or other medical officer.</td>\n</tr>\n<tr>\n<th>CRU</th>\n<td>clinical\
      \ research unit</td>\n</tr>\n<tr>\n<th>CSII</th>\n<td>continuous subcutaneous\
      \ insulin infusion</td>\n</tr>\n<tr>\n<th>Duration<sub>above</sub></th>\n<td>duration\
      \ above normal range</td>\n</tr>\n<tr>\n<th>Duration<sub>below</sub></th>\n\
      <td>duration below normal range</td>\n</tr>\n<tr>\n<th>Duration<sub>within</sub></th>\n\
      <td>duration within normal range</td>\n</tr>\n<tr>\n<th>ECG</th>\n<td>electrocardiogram</td>\n\
      </tr>\n<tr>\n<th>enroll</th>\n<td>The act of assigning a patient to a treatment.\
      \ Patients who are enrolled in the study are those who have been\n      assigned\
      \ to a treatment.</td>\n</tr>\n<tr>\n<th>enter</th>\n<td>Patients entered into\
      \ a study are those who sign the informed consent form directly or through their\
      \ legally\n      acceptable representatives.</td>\n</tr>\n<tr>\n<th>ERB</th>\n\
      <td>ethical review board</td>\n</tr>\n<tr>\n<th>FSH</th>\n<td>follicle-stimulating\
      \ hormone</td>\n</tr>\n<tr>\n<th>GCP</th>\n<td>good clinical practice</td>\n\
      </tr>\n<tr>\n<th>HbA1c</th>\n<td>hemoglobin A1c</td>\n</tr>\n<tr>\n<th>HIV</th>\n\
      <td>human immunodeficiency virus</td>\n</tr>\n<tr>\n<th>IB</th>\n<td>Investigator's\
      \ Brochure</td>\n</tr>\n<tr>\n<th>ICF</th>\n<td>informed consent form</td>\n\
      </tr>\n<tr>\n<th>ICH</th>\n<td>International Council for Harmonization</td>\n\
      </tr>\n<tr>\n<th>informed consent</th>\n<td>A process by which a patient voluntarily\
      \ confirms his or her willingness to participate in a particular study,\n  \
      \    after having been informed of all aspects of the study that are relevant\n\
      \      to the patient's decision to participate. Informed consent is documented\
      \ by means of a written, signed and dated\n      informed consent form.</td>\n\
      </tr>\n<tr>\n<th>interim analysis</th>\n<td>An interim analysis is an analysis\
      \ of clinical study data, separated into treatment groups, that is conducted\n\
      \      before the final reporting database is created/locked.</td>\n</tr>\n\
      <tr>\n<th>investigational product</th>\n<td>A pharmaceutical form of an active\
      \ ingredient or placebo being tested or used as a reference in a clinical\n\
      \      study, including products already on the market when used or assembled\
      \ (formulated or packaged) in a way different\n      from the authorized form,\
      \ or marketed products used for an unauthorized indication, or marketed products\
      \ used to\n      gain\n      further information about the authorized form.</td>\n\
      </tr>\n<tr>\n<th>investigator</th>\n<td>A person responsible for the conduct\
      \ of the clinical study at a study site. If a study is conducted by a\n    \
      \  team of individuals at a study site, the investigator is the responsible\
      \ leader of the team and may be called the\n      principal investigator.</td>\n\
      </tr>\n<tr>\n<th>IM</th>\n<td>intramuscular</td>\n</tr>\n<tr>\n<th>IMG</th>\n\
      <td> intramuscular glucagon</td>\n</tr>\n<tr>\n<th>IV</th>\n<td> intravenous</td>\n\
      </tr>\n<tr>\n<th>NCA</th>\n<td> noncompartmental methods of analysis</td>\n\
      </tr>\n<tr>\n<th>NIM</th>\n<td> non-inferiority margin</td>\n</tr>\n<tr>\n<th>OAM</th>\n\
      <td> oral anti-hyperglycemic medication</td>\n</tr>\n<tr>\n<th>open-label</th>\n\
      <td> A study in which there are no restrictions on knowledge of treatment allocation,\
      \ therefore the investigator and\n      the study participant are aware of the\
      \ drug therapy received during the study.</td>\n</tr>\n<tr>\n<th>randomize</th>\n\
      <td>The process of assigning patients to an experimental group on a random basis.</td>\n\
      </tr>\n<tr>\n<th>PD</th>\n<td> pharmacodynamic(s)</td>\n</tr>\n<tr>\n<th>PK</th>\n\
      <td> pharmacokinetic(s)</td>\n</tr>\n<tr>\n<th>PG</th>\n<td> plasma glucose</td>\n\
      </tr>\n<tr>\n<th>SAE</th>\n<td> serious adverse event</td>\n</tr>\n<tr>\n<th>SAP</th>\n\
      <td> statistical analysis plan</td>\n</tr>\n<tr>\n<th>screen\n<td> The act of\
      \ determining if an individual meets minimum requirements to become part of\
      \ a pool of potential\n      candidates for participation in a clinical study.</td>\n\
      </th></tr>\n<tr>\n<th>SUSARs</th>\n<td>suspected unexpected serious adverse\
      \ reactions</td>\n</tr>\n<tr>\n<th>t<sub>above</sub></th>\n<td>time to concentrations\
      \ above normal range</td>\n</tr>\n<tr>\n<th>t<sub>below</sub></th>\n<td>time\
      \ to concentrations below normal range (after t above )</td>\n</tr>\n<tr>\n\
      <th>TBL</th>\n<td>total bilirubin</td>\n</tr>\n<tr>\n<th>TE ADA</th>\n<td>treatment-emergent\
      \ antidrug antibodies</td>\n</tr>\n<tr>\n<th>TEAE</th>\n<td>treatment-emergent\
      \ adverse event: Any untoward medical occurrence that emerges\n      during\
      \ a defined treatment period, having been absent pretreatment, or worsens relative\n\
      \      to the pretreatment state, and does not necessarily have to have a causal\
      \ relationship\n      with this treatment.</td>\n</tr>\n<tr>\n<th>T<sub>max</sub></th>\n\
      <td>time to maximal concentration</td>\n</tr>\n<tr>\n<th>t<sub>within</sub></th>\n\
      <td>time to concentrations within normal range</td>\n</tr>\n<tr>\n<th>T1DM</th>\n\
      <td>type 1 diabetes mellitus</td>\n</tr>\n<tr>\n<th>T2DM</th>\n<td>type 2 diabetes\
      \ mellitus</td>\n</tr>\n<tr>\n<th>ULN</th>\n<td>upper limit of normal</td>\n\
      </tr>\n<tr>\n<th>WHO</th>\n<td>World Health Organization</td>\n</tr>\n</table></div>"
