    sectionNumber: Appendix 2.
    sectionTitle: Clinical Laboratory Tests
    text: "<div><style>\n  ul.no-bullets {\n    list-style-type: none;\n    margin:\
      \ 0;\n    padding: 5;\n  }\n</style>\n<p><b>Safety Laboratory Tests</b></p>\n\
      <table class=\"table\">\n<tr>\n<td>\n<p><b>Hematology<sup>a</sup></b></p>\n\
      <p><ul class=\"no-bullets\">\n<li>Hematocrit</li>\n<li>Hemoglobin</li>\n<li>Erythrocyte\
      \ count (RBC)</li>\n<li>Mean cell volume</li>\n<li>Mean cell hemoglobin</li>\n\
      <li>Mean cell hemoglobin concentration</li>\n<li>Platelets</li>\n<li>Leukocytes\
      \ (WBC)</li>\n<li>Cell morphology</li>\n<li>Relative/% counts of:</li>\n<li>Neutrophils</li>\n\
      <li>Lymphocytes</li>\n<li>Monocytes</li>\n<li>Eosinophils</li>\n<li>Basophil</li>\n\
      </ul></p>\n<p><b>Urinalysis<sup>a</sup></b></p>\n<p><ul class=\"no-bullets\"\
      >\n<li>Specific gravity</li>\n<li>pH</li>\n<li>Protein</li>\n<li>Glucose</li>\n\
      <li>Ketones</li>\n<li>Bilirubin</li>\n<li>Urobilinogen</li>\n<li>Blood </li>\n\
      <li>Nitrite</li>\n</ul></p>\n<p>Pregnancy test<br/>\n        FSH<sup>b,e</sup><br/>\n\
      \        Ethanol testing<sup>b</sup><br/>\n        Urine drug screen<sup>b</sup><br/>\n\
      </p>\n</td>\n<td>\n<p><b>Clinical Chemistry<sup>a</sup></b></p>\n<p><ul class=\"\
      no-bullets\">\n<li>Sodium</li>\n<li>Potassium</li>\n<li>Chloride</li>\n<li>Calcium</li>\n\
      <li>Phosphorus</li>\n<li>Plasma Glucose</li>\n<li>Blood urea nitrogen (BUN)</li>\n\
      <li>Uric acid</li>\n<li>Total cholesterol</li>\n<li>Total protein</li>\n<li>Albumin</li>\n\
      <li>Total bilirubin</li>\n<li>Alkaline phosphatase (ALP)</li>\n<li>Aspartate\
      \ aminotransferase (AST)</li>\n<li>Alanine aminotransferase (ALT)</li>\n<li>Creatinine</li>\n\
      <li>Gamma-glutamyl transferase (GGT)</li>\n<li>Insulin</li>\n</ul></p>\n<p>HbA1c\
      \ c</p>\n<p><b>Clinical Serology Test<sup>b</sup></b></p>\n<ul class=\"no-bullets\"\
      >\n<li>Hepatitis B surface antigen</li>\n<li>Hepatitis C antibody</li>\n<li>HIV</li>\n\
      <li>Syphilis</li>\n</ul>\n</td>\n</tr>\n</table>\n<p><small>Abbreviations: FSH\
      \ = follicle-stimulating hormone; HbA1c = hemoglobin A1c; HIV = human immunodeficiency\
      \ virus;\n    RBC = red blood cells; WBC = white blood cells.</small></p>\n\
      <p><sup>a</sup> Performed by the local laboratory at screening. Performed by\
      \ the sponsor-designated central laboratory\n  at every treatment period and\
      \ follow-up visit.</p>\n<p><sup>b</sup> Performed at screening only by the local\
      \ laboratory.</p>\n<p><sup>c</sup> Performed by the local laboratory at screening\
      \ and by the sponsor-designated central laboratory at other\n  time point(s).</p>\n\
      <p><sup>d</sup> Female patients of childbearing potential only. Serum pregnancy\
      \ test at screening and urine pregnancy\n  tests at\n  every treatment period\
      \ and follow-up visit will be performed by the local laboratory. e Female patients\
      \ only, when\n  needed to confirm postmenopausal status.</p></div>"
