  - id: NarrativeContent_107
    instanceType: NarrativeContent
    name: SECTION Appendix 3.
    sectionNumber: Appendix 3.
    sectionTitle: Study Governance, Regulatory and Ethical Considerations
    text: "<div><p><b>Informed Consent</b></p>\n<p>The investigator is responsible\
      \ for:</p>\n<ul>\n<li>\n<p>ensuring that the patient understands the nature\
      \ of the study, the potential risks and benefits of participating\n      in\
      \ the study, and that their participation is voluntary.</p>\n</li>\n<li>\n<p>ensuring\
      \ that informed consent is given by each patient or legal representative. This\
      \ includes obtaining the\n      appropriate signatures and dates on the informed\
      \ consent form (ICF) prior to the performance of any protocol\n      procedures\
      \ and prior to the administration of investigational product.</p>\n</li>\n<li>\n\
      <p>answering any questions the patient may have throughout the study and sharing\
      \ in a timely manner any new\n      information that may be relevant to the\
      \ patient's willingness to continue his or her participation in the study.\n\
      \    </p>\n</li>\n<li>\n<p>providing a copy of the ICF to the participant or\
      \ the participant's legal representative and retaining a copy on\n      file.</p>\n\
      </li>\n</ul>\n<p><b>Recruitment</b></p>\n<p>Lilly or its designee is responsible\
      \ for the central recruitment strategy for patients. Individual investigators\
      \ may\n  have additional local requirements or processes. Study-specific recruitment\
      \ material should be approved by Lilly.</p>\n<p><b>Ethical Review</b></p>\n\
      <p>The investigator must give assurance that the ethical review board (ERB)\
      \ was properly constituted and convened as\n  required by International Council\
      \ for Harmonization (ICH) guidelines and other applicable laws and regulations.</p>\n\
      <p>Documentation of ERB approval of the protocol and the ICF must be provided\
      \ to Lilly before the study may begin at the\n  investigative site(s). Lilly\
      \ or its representatives must approve the ICF before it is used at the investigative\n\
      \  site(s). All ICFs must be compliant with the ICH guideline on good clinical\
      \ practice (GCP).</p>\n<p>The study site's ERB(s) should be provided with the\
      \ following:</p>\n<ul>\n<li>\n<p>the current Investigator's Brochure or Package\
      \ Insert and updates during the course of the study</p>\n</li>\n<li>\n<p>ICF</p>\n\
      </li>\n<li>\n<p>relevant curricula vitae</p>\n</li>\n</ul>\n<p><b>Regulatory\
      \ Considerations</b></p>\n<p>This study will be conducted in accordance with\
      \ the protocol and with:</p>\n<ol>\n<li>\n<p>consensus ethics principles derived\
      \ from international ethics guidelines including the Declaration of Helsinki\n\
      \      and Council for Internationa Organizations of Medical Sciences (CIOMS)\
      \ International Ethical Guidelin\n  </p></li>\n<li>\n<p>applicable ICH GCP Guidelin\n\
      \  </p></li>\n<li>\n<p>applicable laws and regulatio\n  </p></li>\n</ol>\n<p>Some\
      \ of the obligations of the sponsor will be assigned to a third party organization.</p>\n\
      <p><b>Protocol Signatures</b></p>\n<p>The sponsor's responsible medical officer\
      \ will approve the protocol, confirming that, to the best of his or her\n  knowledge,\
      \ the protocol accurately describes the planned design and conduct of the study.</p>\n\
      <p>After reading the protocol, each principal investigator will sign the protocol\
      \ signature page and send a copy of the\n  signed page to a Lilly representative.</p>\n\
      <p><b>Final Report Signature</b></p>\n<p>The final report coordinating investigator\
      \ or designee will sign the clinical study report for this study, indicating\n\
      \  agreement that, to the best of his or her knowledge, the report accurately\
      \ describes the conduct and results of the\n  study.</p>\n<p>The investigator\
      \ with the most enrolled patients will serve as the final report coordinating\
      \ investigator. If this\n  investigator is unable to fulfill this function,\
      \ another investigator will be chosen by Lilly to serve as the final\n  report\
      \ coordinating investigator.</p>\n<p>The sponsor's responsible medical officer\
      \ and statistician will sign/approve the final clinical study report for this\n\
      \  study, confirming that, to the best of his or her knowledge, the report accurately\
      \ describes the conduct and results\n  of the study.</p>\n<p><b>Data Quality\
      \ Assurance</b></p>\n<p>To ensure accurate, complete, and reliable data, Lilly\
      \ or its representatives will do the following:</p>\n<ul>\n<ul><p>provide instructional\
      \ material to the study sites, as appropriate.</p></ul>\n<ul><p>provide training\
      \ to instruct the investigators and study coordinators. This training will give\
      \ instruction on the</p></ul>\n<ul>  protocol, the completion of the case report\
      \ forms (CRFs), and study procedures.</ul>\n<ul><p>make periodic visits to the\
      \ study site.</p></ul>\n<ul><p>be available for consultation and stay in contact\
      \ with the study site personnel by mail, telephone, and/or fax.</p></ul>\n<ul><p>review\
      \ and evaluate CRF data and/or use standard computer edits to detect errors\
      \ in data collection.</p></ul>\n<ul><p>conduct a quality review of the database.</p></ul>\n\
      </ul>\n<p>In addition, Lilly or its representatives will periodically check\
      \ a sample of the patient data recorded against\n  source documents at the study\
      \ site. The study may be audited by Lilly and/or regulatory agencies at any\
      \ time.\n  Investigators will be given notice before an audit occurs.</p>\n\
      <p>The investigator will keep records of all original source data. This might\
      \ include laboratory tests, medical records,\n  and clinical notes. If requested,\
      \ the investigator will provide the sponsor, applicable regulatory agencies,\
      \ and\n  applicable ERBs with direct access to the original source documents.</p>\n\
      <p><b>Data Collection Tools/Source Data</b></p>\n<p>An electronic data capture\
      \ system will be used in this study. The site must define and retain all source\
      \ records and\n  must maintain a record of any data where source data are directly\
      \ entered into the data capture system.</p>\n<p><b>Data Protection</b></p>\n\
      <p>Data systems used for the study will have controls and requirements in accordance\
      \ with local data protection law.</p>\n<p>The purpose and use of patient personal\
      \ information collected will be provided in a written document to the patient\n\
      \  by the sponsor.</p>\n<p><b>Study and Site Closure </b></p>\n<p><b>Discontinuation\
      \ of Study Sites</b></p>\n<p>Study site participation may be discontinued if\
      \ Lilly or its designee, the investigator, or the ERB of the study site\n  judges\
      \ it necessary for medical, safety, regulatory, or other reasons consistent\
      \ with applicable laws, regulations,\n  and GCP.</p>\n<p><b>Discontinuation\
      \ of the Study</b></p>\n<p>The study will be discontinued if Lilly or its designee\
      \ judges it necessary for medical, safety, regulatory, or other\n  reasons consistent\
      \ with applicable laws, regulations, and GCP.</p></div>"
