  - id: NarrativeContent_108
    instanceType: NarrativeContent
    name: SECTION Appendix 4.
    sectionNumber: Appendix 4.
    sectionTitle: Hepatic Monitoring Tests for Treatment-emergent Abnormality
    text: "<div><style>\n  ul.no-bullets {\n    list-style-type: none;\n    margin:\
      \ 0;\n    padding: 0;\n  }\n</style>\n<p>Selected tests may be obtained in the\
      \ event of a treatment-emergent hepatic abnormality and may be required in\n\
      \  follow-up with patients in consultation with Lilly or its designee clinical\
      \ research physician.</p>\n<p><b>Hepatic Monitoring Tests</b></p>\n<table class=\"\
      table\">\n<tr>\n<td>\n<p><b>Hepatic Hematology<sup>a</sup></b></p>\n<p>\n<ul\
      \ class=\"no-bullets\">\n<li>Hemoglobin</li>\n<li>Hematocrit</li>\n<li>RBC</li>\n\
      <li>WBC</li>\n<li>Neutrophils</li>\n<li>Lymphocytes</li>\n<li>Monocytes</li>\n\
      <li>Eosinophils</li>\n<li>Basophils</li>\n<li>Platelets</li>\n</ul></p>\n<p><b>Hepatic\
      \ Chemistry<sup>a</sup></b></p>\n<p>\n<ul class=\"no-bullets\">\n<li>Total bilirubin</li>\n\
      <li>Conjugated bilirubin</li>\n<li>Alkaline phosphatase</li>\n<li>ALT</li>\n\
      <li>AST</li>\n<li>GGT</li>\n<li>CPK</li>\n</ul>\n</p></td>\n<td>\n<p><b>Haptoglobin<sup>a</sup></b></p>\n\
      <p><b>Hepatic Coagulation<sup>a</sup></b></p>\n<p>\n<ul class=\"no-bullets\"\
      >\n<li>Prothrombin time</li>\n<li>Prothrombin time, INR</li>\n</ul>\n</p>\n\
      <p><b>Hepatic Serologies<sup>a,b</sup></b></p>\n<p>\n<ul class=\"no-bullets\"\
      >\n<li>Hepatitis A antibody, total</li>\n<li>Hepatitis A antibody, IgM</li>\n\
      <li>Hepatitis B surface antigen</li>\n<li>Hepatitis B surface antibody</li>\n\
      <li>Hepatitis B core antibody</li>\n<li>Hepatitis C antibody</li>\n<li>Hepatitis\
      \ E antibody, IgG </li>\n<li>Hepatitis E antibody, IgM</li>\n</ul>\n</p>\n<p><b>Anti-nuclear\
      \ antibody<sup>a</sup></b></p>\n<p><b>Alkaline phosphatase isoenzymes<sup>a</sup></b></p>\n\
      <p><b>Anti-smooth muscle antibody (or anti-actin antibody)<sup>a</sup></b></p>\n\
      </td>\n</tr>\n</table>\n<p><small>ALT = alanine aminotransferase; AST = aspartate\
      \ aminotransferase; CPK = creatinine phosphokinase; GGT =\n    gamma-glutamyl\
      \ transferase; Ig = immunoglobulin; INR = international normalized ratio; RBC\
      \ = red blood cells; WBC =\n    white blood cells.</small></p>\n<p><sup>a</sup>\
      \ Assayed by Lilly-designated laboratory.</p>\n<p><sup>b</sup> Reflex/confirmation\
      \ dependent on regulatory requirements and/or testing availability.</p></div>"
    uuid: 00000000-0000-4000-8000-000000001482
  - id: NarrativeContent_109
    instanceType: NarrativeContent
    name: SECTION Appendix 5.
    sectionNumber: Appendix 5.
    sectionTitle: Blood Sampling Summary
    text: "<div><p>This table summarizes the approximate number of venipunctures and\
      \ blood volumes for all blood sampling (screening,\n  safety laboratories, and\
      \ bioanalytical assays) during the study.</p>\n<p>Protocol I8R-JE-IGBJ Sampling\
      \ Summary</p>\n<table class=\"table\">\n<tr>\n<th>Purpose</th>\n<th>Blood Volume\
      \ per Sample (mL)</th>\n<th>Number of Blood Samples</th>\n<th>Total Volume (mL)</th>\n\
      </tr>\n<tr>\n<td>Screening tests <sup>a,b</sup></td>\n<td>27</td>\n<td>1</td>\n\
      <td>27</td>\n</tr>\n<tr>\n<td>Clinical laboratory tests <sup>a</sup></td>\n\
      <td>9</td>\n<td>3</td>\n<td>27</td>\n</tr>\n<tr>\n<td>Safety glucose monitoring\
      \ <sup>c</sup></td>\n<td>1</td>\n<td>140<sup>d</sup></td>\n<td>140</td>\n</tr>\n\
      <tr>\n<td>Pharmacokinetics (Glucagon)</td>\n<td>4</td>\n<td>32 <sup>e,f</sup></td>\n\
      <td>128</td>\n</tr>\n<tr>\n<td>Pharmacodynamics (Plasma Glucose)</td>\n<td>2</td>\n\
      <td>30</td>\n<td>60</td>\n</tr>\n<tr>\n<td>HbA1c (Period 1)</td>\n<td>2</td>\n\
      <td>1</td>\n<td>2</td>\n</tr>\n<tr>\n<td>Anti-glucagon antibody</td>\n<td>5</td>\n\
      <td>2<sup>e</sup></td>\n<td>10</td>\n</tr>\n<tr>\n<td>Pharmacogenetics</td>\n\
      <td>5</td>\n<td>1</td>\n<td>5</td>\n</tr>\n<tr>\n<td>Total</td>\n<td></td>\n\
      <td></td>\n<td>399</td>\n</tr>\n</table>\n<p><sup>a</sup> Additional samples\
      \ may be drawn if needed for safety purposes.</p>\n<p><sup>b</sup> Because screening\
      \ tests are performed at local laboratories at each site, this volume is an\
      \ estimate and\n  will vary depending on the local laboratory's testing requirements.</p>\n\
      <p><sup>c</sup> Sample volume may vary by each clinical research unit. The number\
      \ of samples may vary by each patient.\n</p>\n<p><sup>d</sup> Number of samples\
      \ for safety glucose monitoring calculated assuming samples are collected approximately\n\
      \  every 3 minutes for 90 minutes during hypoglycemia induction. Samples collected\
      \ for 90 minutes + 120 minutes post\n  glucagon dose = 210 minutes per period/3\
      \ = 70 samples per period \xD7 2 periods = 140 samples total.</p>\n<p><sup>e</sup>\
      \ Samples for immunogenicity should be collected every 12 weeks until the titer\
      \ returns to baseline (ie,\n  returns to within a single 2-fold dilution of\
      \ the baseline titer) or until 1 year after the last dose of study\n  treatment.\
      \ A time-matched pharmacokinetics (glucagon) sample may be collected at the\
