      <p><b>Note:</b> All deletions have been identified by strikethroughs.</p>

      <p>All additions have been identified by the use of underscore.</p>

      <p>The numbering system used for inclusion and exclusion criteria provides a
      unique number for each criterion and allows for efficiency in data collection.</p>

      <p>In case an amendment to the protocol adds a criterion, that criterion will
      receive the next available number, regardless of whether it is an inclusion
      or exclusion criterion.</p>

