  StudyAmendment:
  - id: StudyAmendment_1
    instanceType: StudyAmendment
    number: A
    substantialImpact: true
    summary: "<p>Protocol I8R-JE-IGBJ A Phase 3 Study of Nasal Glucagon (LY900018)\
      \ Compared to Intramuscular Glucagon for Treatment of Insulin-induced Hypoglycemia\
      \ in Japanese Patients with Diabetes Mellitus has been amended. The new protocol\
      \ is indicated by Amendment (a) and will be used to conduct the study in place\
      \ of any preceding version of the protocol.</p>\n<p>The overall changes and\
      \ rationale for the changes made to this protocol are as follows:</p>\n<ul>\n\
      \  <li>An exclusion criterion for patients with retinopathy or maculopathy was\
      \ added due to the potential risk of fundal hemorrhage induced by hypoglycemia.</li>\n\
      \  <li>The GlucaGen reconstitution volume was changed from 1.0 mL to 1.1 mL\
      \ in accordance with instructions in the Summary of Product Characteristics\
      \ (2015).</li>\n</ul>"
    uuid: 00000000-0000-4000-8000-000000000009
