  - id: StudyTitle_2
    instanceType: StudyTitle
    text: A Phase 3 Study of Nasal Glucagon (LY900018) Compared to Intramuscular Glucagon
      for Treatment of Insulin-induced Hypoglycemia in Japanese Patients with Diabetes
      Mellitus
    uuid: 00000000-0000-4000-8000-000000001370
  StudyVersion:
  - id: StudyVersion_1
    instanceType: StudyVersion
    rationale: "<p>Nasal glucagon (LY900018) is a powder formulation of human glucagon\
      \ for the rescue treatment of hypoglycemia packaged\n  in a user-friendly, single-use,\
      \ nasal dosing device that delivers 3 mg glucagon powder for absorption through\
      \ the\n  nasal mucosa. The glucagon component of LY900018 is a synthetic single-chain,\
      \ 29-amino-acid polypeptide identical to\n  human glucagon. LY900018 is being\
      \ developed for the rescue treatment of hypoglycemia.</p>\n<p>Currently, glucagon\
      \ in a liquid form lacks physical and chemical stability; thus, marketed products\
      \ require\n  reconstitution of glucagon powder before the product can be administered\
      \ through intramuscular (IM) injection.\n  LY900018 combines stable, synthetic\
      \ glucagon and a nasal dosing device that for effective use obviates reconstitution,\n\
      \  injection, and moreover, patient inhalation. Because of these advantages,\
      \ LY900018 may offer a significant improvement\n  in the treatment of severe\
      \ hypoglycemia occurring outside of the hospital setting.</p>\n<p>The aim of\
      \ this study is to compare LY900018 with IM glucagon (IMG), a currently approved\
      \ product that requires\n  reconstitution prior to administration through IM\
      \ injection, in Japanese patients with type 1 diabetes mellitus (T1DM)\n  and\
      \ patients with type 2 diabetes mellitus (T2DM) who achieve treatment success\
      \ during controlled insulin-induced\n  hypoglycemia. Treatment success is defined\
      \ as an increase in plasma glucose (PG) to \u226570 mg/dL or an increase of\
      \ \u226520\n  mg/dL from the PG nadir within 30 minutes after receiving glucagon,\
      \ without the patient receiving additional\n  treatments to increase PG. The\
      \ nadir is defined as the minimum PG measurement at the time of or within 10\
      \ minutes\n  following glucagon administration.</p>"
    uuid: 00000000-0000-4000-8000-000000000001
    versionIdentifier: '1'
